N Object，通知内容：这里指定内容将会覆盖上级统一指定的 alert 信息。内容为空则不展示到通知栏。支持字符串形式也支持官方定义的 alert payload结构，在该结构中包含 title 和 subtitle 等官方支持的 key。\"\n                                                },\n                                                \"sound\": {\n                                                    \"notnull\": false,\n                                                    \"type\": \"string\",\n                                                    \"valueLevel\": 3,\n                                                    \"values\": [],\n                                                    \"lengthLevel\": 1,\n                                                    \"lengths\": [\n                                                        7\n                                                    ],\n                                                    \"repeat\": 16,\n                                                    \"comment\": \" String 或 JSON Object，通知提示声音：普通通知： String 类型。如果无此字段，则此消息无声音提示；有此字段，如果找到了指定的声音就播放该声音，否则播放默认声音。如果此字段为空字符串，iOS 7 为默认声音，iOS 8 及以上系统为无声音。告警通知： JSON Object , 支持官方定义的 payload 结构，在该结构中包含 critical 、name 和 volume 等官方支持的 key 。\"\n                                                },\n                                                \"badge\": {\n                                                    \"notnull\": false,\n                                                    \"type\": \"string\",\n                                                    \"valueLevel\": 3,\n                                                    \"values\": [],\n                                                    \"lengthLevel\": 1,\n                                                    \"lengths\": [\n                                                        2\n                                                    ],\n                                                    \"repeat\": 16,\n                                                    \"comment\": \" Int 或 String，应用角标：可设置为 N、+N、-N，N 的取值范围为 [0,99]。若上传的角标值 value 为 10，表示角标会设置为 N、10+N、10-N（值小于 0 时默认清除角标）。为 0 或空字符串，则表示清除角标。如果不填，表示不改变角标数字。MTPush 官方 API Library(SDK) 会默认填充badge值为\\\"+1\\\"。\"\n                                                },\n                                                \"extras\": {\n                                                    \"notnull\": false,\n                                                    \"type\": \"object\",\n                                                    \"valueLevel\": 0,\n                                                    \"values\": [\n                                                        {\n                                                            \"newsid\": {\n                                                                \"notnull\": true,\n                                                                \"type\": \"integer\",\n                                                                \"valueLevel\": 0,\n                                                                \"values\": [\n                                                                    321\n                                                                ],\n                                                                \"lengthLevel\": 1,\n                                                                \"lengths\": [\n                                                                    3\n                                                                ],\n                                                                \"repeat\": 32,\n                                                                \"trend\": {\n                                                                    \"top\": 16\n                                                                }\n                                                            }\n                                                        }\n                                                    ],\n                                                    \"comment\": \" 扩展字段：这里自定义 Key/value 信息，以供业务使用。\"\n                                                }\n                                            }\n                                        ],\n                                        \"comment\": \"iOS 平台上 APNs 通知。该通知内容会由 MTPush 代理发往 Apple APNs 服务器，并在 iOS 设备上在系统通知的方式呈现。\"\n                                    },\n                                    \"alert\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": false,\n                                        \"comment\": \"String 或 JSON Object，通知内容：这里指定后会覆盖上级统一指定的 alert 信息。内容可以为空字符串，表示不展示到通知栏。各推送通道对此字段的限制详见 推送限制。\"\n                                    },\n                                    \"title\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": false,\n                                        \"comment\": \" 通知标题：如果指定了，则通知里原来展示 App 名称的地方，将展示 title。各推送通道对此字段的限制详见 推送限制 。\"\n                                    },\n                                    \"builder_id\": {\n                                        \"type\": \"integer\",\n                                        \"notnull\": false,\n                                        \"comment\": \" 通知栏样式ID：Android SDK 可 设置通知栏样式，这里根据样式 ID 来指定该使用哪套样式。\"\n                                    },\n                                    \"extras\": {\n                                        \"type\": \"object\",\n                                        \"notnull\": false,\n                                        \"comment\": \" 扩展字段：这里自定义 JSON 格式的 Key/Value 信息，以供业务使用。\"\n                                    }\n                                }\n                            ],\n                            \"comment\": \"通知内容体，是被推送到客户端的内容。与 message 一起二者必须有其一，二者不可以并存。\"\n                        },\n                        \"message\": {\n                            \"notnull\": true,\n                            \"type\": \"object\",\n                            \"valueLevel\": 0,\n                            \"values\": [\n                                {\n                                    \"msg_content\": {\n                                        \"notnull\": true,\n                                        \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            9\n                                        ],\n                                        \"repeat\": 16,\n                                        \"comment\": \"String 或 JSON Object，消息内容本身\"\n                                    },\n                                    \"content_type\": {\n                                        \"notnull\": false,\n                                        \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            4\n                                        ],\n                                        \"repeat\": 16,\n                                        \"comment\": \" 消息内容类型\"\n                                    },\n                                    \"title\": {\n                                        \"notnull\": false,\n                                        \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            3\n                                        ],\n                                        \"repeat\": 16,\n                                        \"comment\": \" 消息标题\"\n                                    },\n                                    \"extras\": {\n                                        \"notnull\": false,\n                                        \"type\": \"object\",\n                                        \"valueLevel\": 0,\n                                        \"values\": [\n                                            {\n                                                \"key\": {\n                                                    \"notnull\": true,\n                                                    \"type\": \"string\",\n                                                    \"valueLevel\": 3,\n                                                    \"values\": [],\n                                                    \"lengthLevel\": 1,\n                                                    \"lengths\": [\n                                                        5\n                                                    ],\n                                                    \"repeat\": 16\n                                                }\n                                            }\n                                        ],\n                                        \"comment\": \" JSON 格式的可选参数\"\n                                    }\n                                }\n                            ],\n                            \"comment\": \"消息内容体，是被推送到客户端的内容。与 notification 一起二者必须有其一，二者不可以并存。\"\n                        },\n                        \"options\": {\n                            \"notnull\": false,\n                            \"type\": \"object\",\n                            \"valueLevel\": 0,\n                            \"values\": [\n                                {\n                                    \"time_to_live\": {\n                                        \"notnull\": false,\n                                        \"type\": \"integer\",\n                                        \"valueLevel\": 0,\n                                        \"values\": [\n                                            60\n                                        ],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            2\n                                        ],\n                                        \"repeat\": 32,\n                                        \"trend\": {\n                                            \"top\": 16\n                                        },\n                                        \"comment\": \" Int 或 String，离线消息保留时长(秒)：若推送时用户不在线，可为该用户保留指定时长的离线消息，以便其上线时再次推送。默认 86400 （1 天），最长 15 天，若厂商支持的最大值 < 传递的有效值，则以厂商最大值为准。设置为 0 表示不保留离线消息，只有推送当前在线的用户可以收到。\"\n                                    },\n                                    \"apns_production\": {\n                                        \"notnull\": false,\n                                        \"type\": \"boolean\",\n                                        \"valueLevel\": 0,\n                                        \"values\": [\n                                            false\n                                        ],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [],\n                                        \"repeat\": 16,\n                                        \"comment\": \" APNs 是否生产环境：该字段仅对 iOS 的 Notification 有效，如果不指定则为推送生产环境。注意：MTPush 官方 API LIbrary (SDK) 默认设置为推送 “开发环境”。true：表示推送生产环境。false：表示推送开发环境。\"\n                                    }\n                                }\n                            ],\n                            \"comment\": \" 推送参数\"\n                        },\n                        \"ios\": {\n                            \"type\": \"object\",\n                            \"notnull\": false,\n                            \"comment\": \"ios 平台推送参数，详见 ios 说明\"\n                        }\n                    }\n                ],\n                \"comment\": \"发送请求体\"\n            },\n            \"request_id\": {\n                \"notnull\": false,\n                \"type\": \"string\",\n                \"valueLevel\": 3,\n                \"values\": [],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    8\n                ],\n                \"repeat\": 16,\n                \"comment\": \" 客户自定义的可选字段，客户用来标识是哪条请求，响应时返回。\"\n            },\n            \"custom_args\": {\n                \"notnull\": false,\n                \"type\": \"string\",\n                \"valueLevel\": 3,\n                \"values\": [],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    13\n                ],\n                \"repeat\": 16,\n                \"comment\": \" 客户自定义的可选字段，回调时返回给客户。\"\n            },\n            \"notification\": {\n                \"values\": [\n                    {\n                        \"type\": \"number\",\n                        \"notnull\": false,\n                        \"android\": {\n                            \"values\": [\n                                {\n                                    \"type\": \"number\",\n                                    \"notnull\": false,\n                                    \"large_icon\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": true,\n                                        \"comment\": \"push.api.engagelab.cc/largeIcon.jpg\\\",\"\n                                    },\n                                    \"small_icon\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": true,\n                                        \"comment\": \"www.small.com/small_icon.jpg\\\",\"\n                                    }\n                                }\n                            ]\n                        }\n                    }\n                ]\n            },\n            \"third_party_channel\": {\n                \"values\": [\n                    {\n                        \"type\": \"number\",\n                        \"notnull\": false,\n                        \"xiaomi\": {\n                            \"values\": [\n                                {\n                                    \"type\": \"number\",\n                                    \"notnull\": false,\n                                    \"small_icon_uri\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": true,\n                                        \"comment\": \"f6.market.xiaomi.com/download/MiPass/x/x.png\\\",\"\n                                    }\n                                }\n                            ]\n                        },\n                        \"huawei\": {\n                            \"values\": [\n                                {\n                                    \"type\": \"number\",\n                                    \"notnull\": false,\n                                    \"small_icon_uri\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": true,\n                                        \"comment\": \"xx.com/xx.jpg\\\",\"\n                                    }\n                                }\n                            ]\n                        }\n                    }\n                ]\n            }\n        }\n    ]\n}','Authorization: Basic Yzk2ZjQyZTBkMmU2NjJlNDVkMDM1YWIxOmRmNGQ1OWU4NGVhYzJmOWQ1M2IzNmYxMg==','2023-04-25 14:31:43','\n# 创建推送 API\n\n向某单个设备或者某设备列表推送一条通知、或者消息。\n推送的内容只能是 JSON 表示的一个推送对象。<br/>\n\n:::\n这是 Push API 最近的版本。v4 版本的改进为：\n\n- 使用 HTTP Basic Authentication 的方式做访问授权。这样整个 API 请求可以使用常见的 HTTP 工具来完成，比如：curl，浏览器插件等。\n- 推送内容完全使用 JSON 的格式。\n:::\n\n\n## 调用验证\n\n详情参见 REST API 概述的 [鉴权方式](/zh_CN/docs/app-push/rest-api/rest-api-overview#鉴权方式) 说明。\n\n## 调用地址\n\n`POST https://push.api.engagelab.cc/v4/push`\n\n## 请求示例\n**请求头**\n```json\n> POST /v4/push HTTP/1.1\n> Authorization: Basic Yzk2ZjQyZTBkMmU2NjJlNDVkMDM1YWIxOmRmNGQ1OWU4NGVhYzJmOWQ1M2IzNmYxMg==\n```\n\n**请求体**\n```json\n{\n    \"from\": \"push\",\n    \"to\": \"all\",\n    \"body\": {\n        \"platform\": \"all\",\n        \"notification\": {\n            \"android\": {\n                \"alert\": \"Hi, Push!\",\n                \"title\": \"Send to Android\",\n                \"builder_id\": 1,\n                \"extras\": {\n                    \"newsid\": 321\n                }\n            },\n            \"ios\": {\n                \"alert\": \"Hi, MTPush!\",\n                \"sound\": \"default\",\n                \"badge\": \"+1\",\n                \"extras\": {\n                    \"newsid\": 321\n                }\n            }\n        },\n        \"message\": {\n            \"msg_content\": \"Hi,MTPush\",\n            \"content_type\": \"text\",\n            \"title\": \"msg\",\n            \"extras\": {\n                \"key\": \"value\"\n            }\n        },\n        \"options\": {\n            \"time_to_live\": 60,\n            \"apns_production\": false\n        }\n    },\n    \"request_id\": \"12345678\",\n    \"custom_args\": \"business info\"\n}\'\n> POST /v4/push HTTP/1.1\n> Authorization: Basic Yzk2ZjQyZTBkMmU2NjJlNDVkMDM1YWIxOmRmNGQ1OWU4NGVhYzJmOWQ1M2IzNmYxMg==\n```\n\n## 请求参数\n\n推送的参数结构体，详见下表：\n\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| from | String  | 可选 | 当前业务发送方 |\n| to | String 或 JSON Object | 必填 | 发送目标 |\n| %% body | JSON Object | 必填 | 发送请求体 |\n| %%% platform | String  或 JSON Array | 必填 | 推送平台 |\n| %%% notification | JSON Object | 可选 |<li>通知内容体，是被推送到客户端的内容。<li>与 message 一起二者必须有其一，二者不可以并存。|\n| %%% message | JSON Object | 可选 |<li>消息内容体，是被推送到客户端的内容。<li>与 notification 一起二者必须有其一，二者不可以并存。|\n| %%% options | JSON Object | 可选 | 推送参数 |\n| request_id | String  | 可选 | 客户自定义的可选字段，客户用来标识是哪条请求，响应时返回。 |\n| custom_args | JSON Object | 可选 | 客户自定义的可选字段，回调时返回给客户。 |\n\n\n## from\n当前业务发送方，String  类型，可选字段。\n#### 请求示例\n```json\n{\n    \"from\":\"push\"\n}\n```\n## to\n\n推送设备对象，表示一条推送可以被推送到哪些设备列表。确认推送设备对象，MTPush 提供了两种方式，分别是广播和注册 ID。\n\n#### 推送目标\n| **关键字** | **类型** | **含义** | **说明** | **备注** |\n| --- | --- | --- | --- | --- |\n| all | String  | 发广播 | 给全部设备进行推送 | 推送目标为 30 天内活跃过的设备。 |\n| registration_id | JSON Array | 注册 ID | 数组。多个注册 ID 之间是 OR 关系，即取并集。 | 设备标识。一次推送最多 1000 个。 |\n\n\n#### 请求示例\n\n- 推送给全部（广播）：\n\n```json\n{\n  \"to\": \"all\",\n}\n```\n\n- 推送给多个注册 ID：\n\n```json\n{\n  \"to\": {\n    \"registration_id\": [\n      \"4312kjklfds2\",\n      \"8914afd2\",\n      \"45fdsa31\"\n    ]\n  }\n}\n```\n\n\n## body\n发送请求体。支持的字段如下：\n\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| platform | String  或 JSON Array | 必填 | 推送平台 |\n| notification | JSON Object | 可选 |<li>通知内容体，是被推送到客户端的内容。<li>与 message 一起二者必须有其一，二者不可以并存。|\n| message | JSON Object | 可选 |<li>消息内容体，是被推送到客户端的内容。<li>与 notification 一起二者必须有其一，二者不可以并存。|\n| options | JSON Object | 可选 | 推送参数 |\n\n\n### platform\n\nMTPush 当前支持 Android， iOS 平台的推送。其关键字分别为：\"android\", \"ios\"。\n\n:::\n如果目标平台为 iOS 平台，需要在 options 中通过 apns_production 字段来制定推送环境。True 表示推送生产环境，False 表示要推送开发环境； 如果不指定则为推送生产环境。\n:::\n\n推送到所有平台：\n\n```json\n{ \"platform\" : \"all\" }\n```\n\n指定特定推送平台：\n\n```json\n{\n  \"platform\": [\n    \"android\",\n    \"ios\"\n  ]\n}\n```\n\n\n### notification\n\n“通知”对象，是一条推送的实体内容对象之一（另一个是“消息”），是会作为“通知”推送到客户端的。\n\n| **关键字** | **类型** | **选项** | **含义** | **说明** |\n| --- | --- | --- | --- | --- |\n| alert | String  或 JSON Object | 必填 | 内容 | 消息内容本身。若 android、ios 下没有指定 alert，则以此为准。 |\n| android | JSON Object | 选填 | android 平台属性 | android 平台推送参数，详见 [android 说明](#android) |\n| ios | JSON Object | 选填 | ios 平台属性 | ios 平台推送参数，详见 [ios 说明](#ios)  |\n\n\n#### alert\n\n这个位置的 \"alert\" 属性（直接在 notification 对象下），是一个快捷定义，各平台的 alert 信息如果都一样，则可不定义平台下的 alert，以此为准。如果各平台有定义，则覆盖这里的定义。\n\n```json\n{\n  \"notification\" : {\n    \"alert\" : \"Hello, Push!\"\n  }\n}\n```\n\n上面定义的 notification 对象，将被推送到 \"platform\" 指定的多个平台，并且其通知 alert 信息都一样。\n\n#### android\n\nAndroid 平台上的通知，被 MTPush SDK 按照一定的通知栏样式展示。支持的字段如下：\n\n| **关键字** | **类型** | **选项** | **含义** | **说明** |\n| --- | --- | --- | --- | --- |\n| alert | String  或 JSON Object | 必填 | 通知内容 |<li>这里指定后会覆盖上级统一指定的 alert 信息。<li>内容可以为空字符串，表示不展示到通知栏。<li>各推送通道对此字段的限制详见 [推送限制](/zh_CN/docs/app-push/rest-api/create-push-api#推送限制)。|\n| title | String  | 可选 | 通知标题 |<li>如果指定了，则通知里原来展示 App 名称的地方，将展示 title。<li>各推送通道对此字段的限制详见 [推送限制](/zh_CN/docs/app-push/rest-api/create-push-api#推送限制) 。|\n| builder_id | Int | 可选 | 通知栏样式ID | Android SDK 可 [设置通知栏样式](/zh_CN/docs/app-push/client-sdk-reference/android-sdk/sdk-api-guide#设置自定义通知布局)，这里根据样式 ID 来指定该使用哪套样式。 |\n| channel_id | String  | 可选 | Android 通知栏通道 ID | 不超过 1000 字节，Android 8.0开始可以进行NotificationChannel 配置，这里根据 channel ID 来指定通知栏展示效果。 |\n| priority | Int | 可选 | 通知栏展示优先级 | 默认为 0，范围为 -2～2。 |\n| category | String  | 可选 | 通知栏条目过滤或排序 | 完全依赖 rom 厂商对 category 的处理策略。 |\n| style | Int | 可选 | 通知栏样式类型 | 用来指定通知栏样式类型，默认为 0。|<li>1：bigText<li>2：Inbox<li>3：bigPicture|\n| big_text | String  | 可选 | 大文本通知栏样式 |<li>当 style = 1 时可用，内容会被通知栏以大文本的形式展示出来。<li>支持 api 16 以上的 rom。|\n| inbox | JSONObject | 可选 | 文本条目通知栏样式 |<li>当 style = 2 时可用， json 的每个 key 对应的 value 会被当作文本条目逐条展示。<li>支持 api 16 以上的 rom。|\n| big_pic_path | String  | 可选 | 文本条目通知栏样式 |<li>当 style = 3 时可用，目前支持 .jpg 和 .png 格式的图片。<li>支持网络图片 url、本地图片的 path，如果是 http／https 的 url，会自动下载；如果要指定开发者准备的本地图片就填 sdcard 的相对路径。<li>支持 api 16 以上的 rom。|\n| extras | JSON Object | 可选 | 扩展字段 | 这里自定义 JSON 格式的 Key/Value 信息，以供业务使用。 |\n| intent | JSON Object | 可选 | 指定跳转页面(推荐) | 使用 intent 里的 url 指定点击通知栏后跳转的目标页面。建议填写 intent 字段，否则点击通知可能无跳转动作。此字段支持以下三种类型:<li>跳转到目标页:<br/>intent:#Intent;action=action 路径;component= 包名 /Activity 全名;end<li>应用首页: intent:#Intent;action=android.intent.action.MAIN;end (固定为此地址) <li>跳转到deeplink地址:<br/> scheme://test?key1=val1&key2=val2 |\n| large_icon | String  | 可选 | 通知大图标 |<li>图标大小不超过 300 k。<li>支持网络图片 url、本地图片的 path，如果是 http／https 的 url，会自动下载；如果要指定开发者准备的本地图片就填 sdcard 的相对路径。|\n| small_icon | String  | 可选 | 通知小图标 |<li>通知小图标，图标路径可以是以 http 或 https 开头的网络图片，大小不能超过 300 k。<li>若没有填充 厂商 small_icon_uri，则默认使用该 small_icon 字段展示。|\n| sound | String  | 可选 | 铃声 |<li>填写 Android 工程中 /res/raw/ 路径下铃声文件名称，无需文件名后缀。<li>**注意：**针对 Android 8.0 以上，当传递了 channel_id 时，此属性不生效。|\n| badge_add_num | Int | 可选 | 设置角标数字累加值，在原角标的基础上进行累加 |<li>此属性目前仅针对华为 EMUI 8.0 及以上、小米 MIUI 6 及以上、vivo 设备走厂商通道时生效。<li>此字段如果不填，表示不改变角标数字（小米设备由于系统控制，不论推送走 Engagelab 通道下发还是厂商通道下发，即使不传递依旧是默认 +1 的效果）。<li>取值范围为：1-99，若设置了取值范围内的数字，下一条通知栏消息配置的 badge_add_num 数据会和原角标数量进行相加，建议取值为 1。<li>举例：badge_add_num 取值为 1，原角标数为 2，发送此角标消息后，应用角标数显示为 3。|\n| badge_class | String  | 可选 | 桌面图标对应的应用入口Activity类， 比如“com.test.badge.MainActivity” |<li>仅华为通道推送时生效，此值如果填写非主 Activity 类，以厂商限制逻辑为准。<li>若需要实现角标累加功能，需配合 badge_add_num 使用，二者需要共存，缺少其一不可。|\n\n\n```json\n{\n    \"notification\": {\n        \"android\": {\n            \"alert\": \"hello, MTPush!\",\n            \"title\": \"Push test\",\n            \"builder_id\": 3,\n            \"style\": 1,\n            \"big_text\": \"big text content\",\n            \"inbox\":JSONObject,\n            \"big_pic_path\": \"picture url\",\n            \"priority\": 0,\n            \"category\": \"category str\",\n            \"large_icon\": \"http://push.api.engagelab.cc/largeIcon.jpg\",\n            \"small_icon\": \"http://www.small.com/small_icon.jpg\",\n            \"intent\": {\n                \"url\": \"intent:#Intent;component=push.api.engagelab.cc/com.example.mtpushdemo.SettingActivity;end\"\n            },\n            \"extras\": {\n                \"news_id\": 134,\n                \"my_key\": \"a value\"\n            }\n        }\n    }\n}\n```\n\n#### ios\n\niOS 平台上 APNs 通知。\n\n该通知内容会由 MTPush 代理发往 Apple APNs 服务器，并在 iOS 设备上在系统通知的方式呈现。\n\n该通知内容满足 APNs 的规范，支持的字段如下：\n\n| **关键字** | **类型** | **选项** | **含义** | **说明** |\n| --- | --- | --- | --- | --- |\n| alert | String  或 JSON Object | 必填 | 通知内容 |<li>这里指定内容将会覆盖上级统一指定的 alert 信息。<li>内容为空则不展示到通知栏。<li>支持字符串形式也支持官方定义的 [alert payload](https://developer.apple.com/library/content/documentation/NetworkingInternet/Conceptual/RemoteNotificationsPG/PayloadKeyReference.html)<li>结构，在该结构中包含 title 和 subtitle 等官方支持的 key。|\n| sound | String  或 JSON Object | 可选 | 通知提示声音 |<li>普通通知： String  类型。<li>如果无此字段，则此消息无声音提示；<li>有此字段，如果找到了指定的声音就播放该声音，否则播放默认声音。<li>如果此字段为空字符串，iOS 7 为默认声音，iOS 8 及以上系统为无声音。<li>告警通知： JSON Object , 支持官方定义的 payload 结构，在该结构中包含 critical 、name 和 volume 等官方支持的 key 。|\n| badge | Int 或 String  | 可选 | 应用角标 |<li>可设置为 N、+N、-N，N 的取值范围为 [0,99]。若上传的角标值 value 为 10，表示角标会设置为 N、10+N、10-N（值小于 0 时默认清除角标）。<li>为 0 或空字符串，则表示清除角标。<li>如果不填，表示不改变角标数字。<li>MTPush 官方 API Library(SDK) 会默认填充badge值为\"+1\"。|\n| content-available | Boolean | 可选 | 推送唤醒 | 推送的时候携带\"content-available\":true 说明是 Background Remote Notification，如果不携带此字段则是普通的Remote Notification。详情参考：[Background Remote Notification](/zh_CN/docs/app-push/client-sdk-reference/ios-sdk/ios-version-feature-guide#ios-7-background-remote-notification) |\n| mutable-content | Boolean | 可选 | 通知扩展 | iOS 10 新增的 Notification Service Extension 功能，用于上报每条 APNs 信息的送达状态，使用该功能需要客户端 [实现 Service Extension 接口](/zh_CN/docs/app-push/client-sdk-reference/ios-sdk/ios-version-feature-guide#ios-10-new-features)，并在服务端使用 mutable-content 字段完成设置。<li>true：说明支持 iOS  10 的UNNotificationServiceExtension 功能。<li>如果不携带此字段则是普通的 Remote Notification，无法统计抵达数据。|\n| category | String  | 可选 |  | iOS 8 才支持。设置APNs payload中的\"category\"字段值。 |\n| extras | JSON Object | 可选 | 扩展字段 | 这里自定义 Key/value 信息，以供业务使用。 |\n| thread-id | String  | 可选 | 通知分组 | iOS 的远程通知通过该属性来对通知进行分组，同一个 thread-id 的通知归为一组。 |\n| interruption-level | String  | 可选 | 通知优先级和交付时间的中断级别 | iOS 15 的通知级别，取值只能是 active,critical,passive,timeSensitive 中的一个，详情参考：[UNNotificationInterruptionLevel](https://developer.apple.com/documentation/usernotifications/unnotificationinterruptionlevel)。 |\n\n\n:::\niOS 通知 MTPush 要转发给 APNs 服务器。\nMTPush 中 Notification + Message 长度限制为 4000 个字节。\nMTPush 在推送时使用 utf-8 编码，所以一个汉字占用 3 个字节长度。\n:::\n\n**服务端发送示例：**\n\n```json\n{\n    \"notification\": {\n        \"ios\": {\n            \"alert\": \"hello, Push!\",\n            \"sound\": \"sound.caf\",\n            \"badge\": 1,\n            \"extras\": {\n                \"news_id\": 134,\n                \"my_key\": \"a value\"\n            }\n        }\n    }\n}\n```\n\n**客户端收到的消息：**\n\n```json\n{\n  \"_j_msgid\" = 813843507;\n  aps =     {\n  alert = \"hello,Push!\";\n  badge = 1;\n  sound = \"sound.caf\";\n};\n\"my_key\" = \"a value\";\n\"news_id\" = 134;\n}\n```\n\n\n### message\n\n应用内消息。或者称作：自定义消息，透传消息。\n\n- 此部分内容不会展示到通知栏上，MTPush SDK 收到消息内容后透传给 App。App 需要自行处理。\n- iOS 在推送应用内消息通道（非 APNS）获取此部分内容，需 App 处于前台。\n\n支持的字段如下：\n\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| msg_content | String  或 JSON Object | 必填 | 消息内容本身 |\n| title | String  | 可选 | 消息标题 |\n| content_type | String  | 可选 | 消息内容类型 |\n| extras | JSON Object | 可选 | JSON 格式的可选参数 |\n\n\n示例：\n\n```json\n{\n  \"message\": {\n    \"msg_content\": \"Hi,Push\",\n    \"content_type\": \"text\",\n    \"title\": \"msg\",\n    \"extras\": {\n      \"key\": \"value\"\n    }\n  }\n}\n```\n\n### options\n\n推送可选项。当前包含如下几个可选项：\n\n| **关键字** | **类型** | **选项** | **含义** | **说明** |\n| --- | --- | --- | --- | --- |\n| time_to_live | Int 或 String  | 可选 | 离线消息保留时长(秒) |<li>若推送时用户不在线，可为该用户保留指定时长的离线消息，以便其上线时再次推送。<li>默认 86400 （1 天），最长 15 天，若厂商支持的最大值 < 传递的有效值，则以厂商最大值为准。<li>设置为 0 表示不保留离线消息，只有推送当前在线的用户可以收到。|\n| override_msg_id | Long | 可选 | 要覆盖的消息 ID | 如果当前的推送要覆盖之前的一条推送，这里填写前一条推送的 msg_id 就会产生覆盖效果，即：<li>该 msg_id 离线收到的消息是覆盖后的内容，即使该 msg_id Android 端用户已经收到，如果通知栏还未清除，则新的消息内容会覆盖之前这条通知。<li>覆盖功能起作用的时限是：1 天，如果在覆盖指定时限内该 msg_id 不存在，则返回 7006 错误，提示不是一次有效的消息覆盖操作，当前的消息不会被推送。<li>该字段仅对 Android 有效仅支持Engagelab 通道、小米通道、魅族通道、OPPO 通道、FCM 通道、华为通道（EMUI10 及以上的设备）。|\n| apns_production | Boolean | 可选 | APNs 是否生产环境 | 该字段仅对 iOS 的 Notification 有效，如果不指定则为推送生产环境。**注意：**MTPush 官方 API LIbrary (SDK) 默认设置为推送 “开发环境”。<li>true：表示推送生产环境。<li>false：表示推送开发环境。|\n| apns_collapse_id | String  | 可选 | 更新 iOS 通知的标识符 |<li>APNs 新通知如果匹配到当前通知中心有相同 apns-collapse-id 字段的通知，则会用新通知内容来更新它，并使其置于通知中心首位。<li>collapse id 长度不可超过 64 bytes。|\n| big_push_duration 			 | Int | 可选 | 定速推送时长(分钟) |<li>又名缓慢推送，把原本尽可能快的推送速度，降低下来，给定的 n 分钟内，均匀地向这次推送的目标用户推送；最大值为 1440。|<li>最多能同时存在 20 条定速推送。<li>未设置则不是定速推送。|\n|multi_language|json object|可选|多语言推送设置| 推送内容多语言适配设置，详情查看 [multi_language](#multi_language) 说明。|\n| third_party_channel | JSON Object | 可选 | Android 厂商通道配置信息 | 仅针对配置了厂商通道的用户有效参数，详情查看 [third_party_channel](#third_party_channel) 说明。 |\n\n#### **multi_language**\n本字段是 EngageLab Push 服务的多语言推送功能。它允许您为不同语言的用户推送定制化的通知内容。通过在推送请求中指定多个语言及对应的消息内容、标题和 iOS 子标题，您可以针对用户的语言设置发送适当的推送通知。</br>\n\n##### 请求参数\n| **关键字** | **类型** | **选项** | **含义** | **说明** |\n| --- | --- | --- | --- | --- |\n|en|string|可选|多语言key|对应推送用户语言，key码详见附录\n|content|string|可选|消息内容|根据用户语言替换notification.android.alert、notification.ios.alert、notification.web.alert、message.msg_content里的数据|\n|title|string|可选|消息标题|根据用户语言替换notification.android.title、notification.ios.alert、notification.web.title、message.title里的数据|\n|ios_subtitle|string|可选|ios子标题|根据用户语言替换notification.ios.alert里的数据|\n\n##### 请求示例\n\n```json\n   http请求方式: Post\n   请求地址：/v4/grouppush 或者 /v4/push\n   POST数据格式:json\n   POST数据例子:\n   {\n    \"options\": {\n      \"multi_language\": {\n        \"en\": {\n          \"content\": \"\",\n          \"title\": \"\",\n          \"ios_subtitle\": \"\"\n        }\n      }\n    }\n   }\n```\n##### 返回示例\n```json\n成功时：\n{\n   \n}\n	\n失败时：\n{   \n	\"code\":400,    \n	\"data\":\"\",\n  \"message\":\"错误信息\"\n}   \n```\n#### **third_party_channel**\n\n本字段用来填写 Android 厂商通道的个性化信息，key 只支持 xiaomi、huawei、meizu、oppo、vivo、fcm、honor 这 7 个 Android 厂商通道，可以为其中一个或者多个同时存在，每个厂商类型的 KEY 当前可包含如下几个可选项：\n:::\n注：多个key存在的情况下，distribution_new取值以厂商通道（xiaomi、huawei、meizu、oppo、vivo、honor）的设置为准。\n:::\n\n##### 请求参数\n| **关键字** | **类型** | **选项** | **含义** | **说明** |\n| --- | --- | --- | --- | --- |\n| distribution_new | String  | 必选 | Engagelab 和厂商通道并存时，设置下发优先级 | 取值不能为空字符串。<li>mtpush：表示推送强制走 Engagelab 通道下发。<li>pns_mtpush：表示表示针对 fcm+ 国内厂商组合类型用户，推送强制优先走小米 / 华为 / 魅族 /oppo/vivo/荣耀 通道下发，无效再走engagelab通道。<li>mtpush_pns：表示针对 fcm+ 国内厂商组合类型用户，推送优先走engagelab，engagelab不在线再走厂商通道，厂商作为辅助。<li>fcm_mtpush：表示表示针对 fcm+ 国内厂商组合类型用户，推送强制优先走 fcm 通道下发，无效再走engagelab通道<li>mtpush_fcm：表示针对 fcm+ 国内厂商组合类型用户，推送优先走engagelab，engagelab不在线再走 fcm 通道，fcm 作为辅助。<br/>_注：针对pns_mtpush/fcm_mtpush/mtpush_pns/mtpush_fcm这四种策略而言，如果设备可用的系统推送通道仅有一种（FCM或者手机厂商），则会忽略强制优先级，走集成成功的系统通道。_ |\n| channel_id | String  | 可选 | 通知栏消息分类 | 支持 [OPPO 的私信](https://open.oppomobile.com/new/developmentDoc/info?id=11227)、[小米的通知消息](https://dev.mi.com/console/doc/detail?pId=2086#faq-permission)、[华为消息分类](https://developer.huawei.com/consumer/cn/doc/development/HMSCore-Guides-V5/message-classification-management-solution-0000001149358835-V5#ZH-CN_TOPIC_0000001149358835__section153801515616)  类别，分类 ChannelID 值需开发者自行向厂商申请。 |\n| classification | Int | 可选 | 通知栏消息分类 | vivo 手机厂商通知栏消息分类，不填默认为 0。<li>0：代表运营消息。<li>1：代表系统消息。<br/>目前 vivo 对系统消息分类较为严格，具体规则参考：vivo开发者平台。 |\n| pushMode | Int | 可选 | vivo推送模式 | 不填默认为 0。详情参考 [vivo pushMode](https://dev.vivo.com.cn/documentCenter/doc/362#w2-98542835)，使用测试推送需要手动在 vivo 后台配置测试设备的 ID 。<li>0：表示正式推送。<li>1：表示测试推送。|\n| importance | String  | 可选 | 华为/荣耀通知栏消息智能分类 | 为了适配华为手机厂商的通知栏消息智能分类，对应华为的 importance 字段，不填充默认为 \"NORMAL\"，参考：[华为通知消息智能分类](https://developer.huawei.com/consumer/cn/doc/development/HMSCore-Guides/message-classification-0000001149358835)。<li>LOW：一般消息。<li>NORMAL：重要消息。<li>HIGH：非常重要消息（仅华为支持）。|\n| urgency | String  | 可选 | 华为厂商自定义消息优先级 | 为了适配华为手机厂商自定义消息的优先级。<li>HIGH：非常重要消息，HIGH 级别消息到达用户手机时可强制拉起应用进程。<li>NORMAL：重要消息。<br/>设置“HIGH”需要向华为申请特殊权限，参考：[特殊权限如何申请](https://developer.huawei.com/consumer/cn/doc/development/HMSCore-Guides-V5/faq-0000001050042183-V5#ZH-CN_TOPIC_0000001134031055__section037425218509)。 |\n| category | String  | 可选 | 华为厂商自定义消息场景标识 | 为了适配华为手机厂商自定义消息，标识高优先级透传消息的特殊场景，或用于标识消息类型以对特定类型消息加快发送，对应值及其说明参考：[category 值说明](https://developer.huawei.com/consumer/cn/doc/development/HMSCore-References/https-send-api-0000001050986197#ZH-CN_TOPIC_0000001134031085__p5203378238)。 |\n| small_icon_uri | String  | 可选 | 厂商消息小图标样式 |<li>目前支持小米 / 华为厂商。<li>优先使用厂商字段， 厂商字段没有填充，则使用 [android 内的 small_icon](#android) 字段。<li>小米支持 [小米厂商的大图标 id](https://dev.mi.com/console/doc/detail?pId=1278#4_4_2)，华为、支持 Engagelab 的 media_id 及厂商本地路径。(小米官方后续不再支持自定义小图标，建议开发者不要继续使用小米 small Icon 相关特性功能)。|\n| small_icon_color | String  | 可选 | 小米厂商小图标样式颜色| 为了适配小米厂商的消息小图标样式颜色，不填充默认是灰色 (小米官方后续不在支持自定义小图标，建议开发者不要继续使用小米 small icon 相关特性功能)。|\n| big_text | String | 可选 | 厂商消息大文本样式 |<li>为了适配厂商的消息大文本样式, 目前支持华为/荣耀/小米/OPPO，其中小米OPPO最多支持128个字符。<li>优先使用此厂商字段， 厂商字段没有填充，则使用 android 里面定义 big_text 字段。<li>android里面字段style=1时使用。|\n| only_use_vendor_style | Boolean | 可选 | 是否使用自身通道设置样式 | 是否只使用自身通道设置的样式，不使用 android 里面设置的样式，默认为 false，<li>true：只使用自身通道设置的样式。<li>false：可使用 android 里面设置的样式。|\n\n\n##### 请求示例\n\n```json\n\"third_party_channel\": {\n    \"xiaomi\": {\n        \"distribution_new\": \"mtpush\",\n        \"channel_id\": \"*******\",\n        \"small_icon_uri\": \"http://f6.market.xiaomi.com/download/MiPass/x/x.png\",\n        \"small_icon_color\": \"#ABCDEF\",\n    },\n    \"huawei\": {\n        \"distribution_new\": \"mtpush_pns\",\n        \"importance\": \"NORMAL\",\n        \"small_icon_uri\": \"https://xx.com/xx.jpg\",\n        \"only_use_vendor_style\": true\n    },\n    \"meizu\": {\n        \"distribution_new\": \"mtpush\"\n    },\n    \"fcm\": {\n        \"distribution_new\": \"mtpush\"\n    },\n    \"oppo\": {\n        \"distribution_new\": \"mtpush\",\n        \"channel_id\": \"*******\",\n        \"large_icon\": \"3653918_5f92b5739ae676f5745bcbf4\",\n    },\n    \"vivo\": {\n        \"distribution_new\": \"mtpush\",\n        \"classification\": 0,\n        \"pushMode\": 0\n    }\n}\n```\n\n## request_id\n请求 id，客户自定义的可选字段。客户用来标识是哪条请求，响应时返回。\n#### 请求示例\n```json\n{\n      \"request_id\":\"12345678\"\n}\n```\n#### 返回示例\n```json\n{\n    \"msg_id\": \"1225764\",\n    \"request_id\": \"12345678\"\n}\n```\n## custom_args\n客户自定义的，可选字段，响应时不返回，回调时返回。\n#### 请求示例\n```json\n{\n  \"custom_args\":\"business info\"\n}\n```\n\n\n## 返回参数\n\n### 成功返回\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| request_id | String | 可选 | 请求时提交的自定义 ID，响应时原样返回。 |\n| message_id | String | 必选 | 消息 ID，唯一标识某一条消息。 |\n\n\n```json\n< HTTP/1.1 200 OK\n< Content-Type: application/json\n{\"request_id\":\"18\",\"msg_id\":\"1828256757\"}\n```\n### 失败返回\nhttp 状态码为 4xx 或者 5xx，响应体包含字段如下：\n\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| code | int | 必选 | 错误码，详见 [错误码](#错误码) 说明 |\n| message | String | 必选 | 错误详情 |\n\n\n```json\n{\n	\"code\": 3002,\n	\"message\": \"Push.template field must be set correctly when type is template\"\n}\n\n```\n\n## 调用返回\n### HTTP 状态码\n\n参考文档：[HTTP-Status-Code](/zh_CN/docs/app-push/rest-api/http-status-code)\n\n### 错误码\n| **Code** | **描述** | **详细解释** | **HTTP Status Code** |\n| --- | --- | --- | --- |\n| 20101 | 推送参数无效 | registration_id 无效或不属于当前 appkey | 400 |\n| 21001 | 只支持 HTTP Post 方法 | 不支持 Get 方法 | 405 |\n| 21002 | 缺少了必须的参数 | 必须改正 | 400 |\n| 21003 | 参数值不合法 | 必须改正 | 400 |\n| 21004 | 验证失败 | 必须改正，详情请看：调用验证 | 401 |\n| 21005 | 消息体太大 | 必须改正， 				Notification+Message长度限制为 2048 字节 | 400 |\n| 21008 | app_key 参数非法 | 必须改正，请仔细对比你所传的 appkey 是否与应用信息中的一致，是否多了空格 | 400 |\n| 21009 | 系统内部错误 | 必须改正 | 400 |\n| 21011 | 没有满足条件的推送目标 | 请检查 to 字段 | 400 |\n| 21015 | 请求参数校验失败 | 存在非预期的参数 | 400 |\n| 21016 | 请求参数校验失败 | 参数类型错误，或者参数长度超出限制 | 400 |\n| 21030 | 内部服务超时 | 稍后重试 | 503 |\n| 23006 | 参数错误 | 定速推送 big_push_duration 超过最大值 1440 | 400 |\n| 27000 | 系统内存错误 | 请重试 | 500 |\n| 27001 | 参数错误 | 校验信息为空 | 401 |\n| 27008 | 参数错误 | third_party_channel 里面的 distribution 不为空，但是 notification 的 alert 内容为空 | 401 |\n| 27009 | 参数错误 | third_party_channel 中 distribution 格式无效或为空 | 401 |\n\n\n## 推送限制\n| **厂商通道** | **标题长度** | **内容长度** | **敏感词** | **其他说明** |\n| --- | --- | --- | --- | --- |\n| Engagelab 通道 | 不限制，但限制消息体总大小 | 不限制，但限制消息体总大小 | - | MTPush 中 Notification + Message 长度限制为 4000 个字节。 |\n| 华为通道 | ＜ 40 个字符 | ＜ 1024 字符 | 禁止携带政府，领导人名称、台独等相关内容 | 默认【营销通知】的权限为静默通知，静默推送没有声音、震动等提示。 |\n| 荣耀通道 | 不限制，但消息体总大小<4096字节 | 不限制，但消息体总大小 ＜ 4096 字节 | 禁止携带政府，领导人名称、台独等相关内容 | - |\n| 魅族通道 | ＜ 32 个字符 | ＜ 100 个字符 | 禁止特殊字符，如：# |<li>中英文字符均计算为 1 个字符。<li>部分消息可能会存入魅族手机右上角【魅族消息盒子】中。|\n| 小米通道 | ＜ 50 个字符 | ＜ 128 个字符 | 禁止特殊字符，如：#、>> |<li>中英文字符均计算为 1 个字符。<li>部分消息可能会存在通知栏的不重要通知里。|\n| OPPO 通道 | ＜ 32 个字符 | ＜ 200 个字符 | 暂无说明 |<li>中英文字符均计算为 1 个字符。<li>默认关闭通知权限。|\n| vivo 通道 | ＜ 40 个字符 | ＜ 100 个字符 | <li>禁止特殊字符，如：#、>><li>正式消息禁止：纯数字、纯英文、纯符号、符号加数字，测试、test、大括号、中括号等 |<li>英文为 1 个字符，中文为 2 个字符。<li>默认关闭通知权限。<li>同设备 1 天内运营消息的推送条数不能超过 5 条。<li>同设备 1 天内不能重复推送内容相同的运营消息。|\n| APNS 通道 | ＜ 20 个字符（40 个英文字符） | <li>通知中心和锁屏状态最多显示 110 个字符，55 个汉字。<li>顶部弹窗最多显示 62 个字符，31 个汉字，超过部分会显示省略号。 | 暂无说明 | 暂无 |\n\n## 多语言码\n| 语言               | Language            | Language Code |\n| ------------------ | ------------------- | ------------- |\n| 英语               | English             | en            |\n| 阿拉伯语           | Arabic              | ar            |\n| 简体中文           | Chinese (Simplified) | zh-Hans       |\n| 繁体中文           | Chinese (Traditional) | zh-Hant       |\n| 捷克语             | Czech               | cs            |\n| 丹麦语             | Danish              | da            |\n| 荷兰语             | Dutch               | nl            |\n| 法语               | French              | fr            |\n| 德语               | German              | de            |\n| 印地语             | Hindi               | hi            |\n| 意大利语           | Italian             | it            |\n| 日语               | Japanese            | ja            |\n| 韩语               | Korean              | ko            |\n| 马来语             | Malay               | ms            |\n| 俄语               | Russian             | ru            |\n| 西班牙语           | Spanish             | es            |\n| 泰语               | Turkish             | th            |\n| 越南语             | Vietnamese          | vi            |'),(1682434635082,0,0,82002,'APIJSON.cn',0,3,NULL,'定时任务 API',NULL,'POST','JSON','/v4/schedules','{\n    \"name\": \"定时推送示例\",\n    \"enabled\": true,\n    \"trigger\": {\n        \"single\": {\n            \"time\": \"2022-11-23 19:20:00\",\n            \"zone_type\": 1\n        }\n    },\n    \"push\": {\n        \"from\": \"push\",\n        \"to\": \"all\",\n        \"body\": {\n            \"platform\": \"all\",\n            \"notification\": {\n                \"android\": {\n                    \"alert\": \"Hi, Push!\",\n                    \"title\": \"Send to Android\",\n                    \"builder_id\": 1,\n                    \"extras\": {\n                        \"newsid\": 321\n                    }\n                },\n                \"ios\": {\n                    \"alert\": \"Hi, MTPush!\",\n                    \"sound\": \"default\",\n                    \"badge\": \"+1\",\n                    \"extras\": {\n                        \"newsid\": 321\n                    }\n                }\n            },\n            \"message\": {\n                \"msg_content\": \"Hi,MTPush\",\n                \"content_type\": \"text\",\n                \"title\": \"msg\",\n                \"extras\": {\n                    \"key\": \"value\"\n                }\n            },\n            \"options\": {\n                \"time_to_live\": 60,\n                \"apns_production\": false\n            }\n        },\n        \"request_id\": \"12345678\",\n        \"custom_args\": \"business info\"\n    }\n}',NULL,NULL,'{\n    \"notnull\": true,\n    \"type\": \"object\",\n    \"valueLevel\": 0,\n    \"values\": [\n        {\n            \"name\": {\n                \"notnull\": true,\n                \"type\": \"string\",\n                \"valueLevel\": 3,\n                \"values\": [],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n       