指定时长的离线消息，以便其上线时再次推送。默认 86400 （1 天），最长 15 天，若厂商支持的最大值 < 传递的有效值，则以厂商最大值为准。设置为 0 表示不保留离线消息，只有推送当前在线的用户可以收到。\"\n                                                },\n                                                \"apns_production\": {\n                                                    \"notnull\": false,\n                                                    \"type\": \"boolean\",\n                                                    \"valueLevel\": 0,\n                                                    \"values\": [\n                                                        false\n                                                    ],\n                                                    \"lengthLevel\": 1,\n                                                    \"lengths\": [],\n                                                    \"comment\": \" APNs 是否生产环境：该字段仅对 iOS 的 Notification 有效，如果不指定则为推送生产环境。注意：MTPush 官方 API LIbrary (SDK) 默认设置为推送 “开发环境”。true：表示推送生产环境。false：表示推送开发环境。\"\n                                                }\n                                            }\n                                        ],\n                                        \"comment\": \" 推送参数\"\n                                    }\n                                }\n                            ],\n                            \"comment\": \"发送请求体\"\n                        },\n                        \"request_id\": {\n                            \"notnull\": false,\n                            \"type\": \"string\",\n                            \"valueLevel\": 3,\n                            \"values\": [],\n                            \"lengthLevel\": 1,\n                            \"lengths\": [\n                                8,\n                                5\n                            ],\n                            \"repeat\": 3,\n                            \"comment\": \" 客户自定义的可选字段，客户用来标识是哪条请求，响应时返回。\"\n                        },\n                        \"custom_args\": {\n                            \"notnull\": false,\n                            \"type\": \"string\",\n                            \"valueLevel\": 3,\n                            \"values\": [],\n                            \"lengthLevel\": 1,\n                            \"lengths\": [\n                                13\n                            ],\n                            \"repeat\": 4,\n                            \"comment\": \" 客户自定义的可选字段，回调时返回给客户。\"\n                        }\n                    }\n                ],\n                \"comment\": \"push 必须为有效合法的 push 动作，否则创建失败。\"\n            },\n            \"total_count\": {\n                \"type\": \"integer\",\n                \"notnull\": false,\n                \"comment\": \"表示总数\"\n            },\n            \"total_pages\": {\n                \"type\": \"integer\",\n                \"notnull\": false,\n                \"comment\": \"总页数。\"\n            },\n            \"page\": {\n                \"type\": \"integer\",\n                \"notnull\": false,\n                \"comment\": \"当前为第四页。\"\n            },\n            \"schedules\": {\n                \"values\": [\n                    {\n                        \"0\": {\n                            \"type\": \"object\",\n                            \"notnull\": true,\n                            \"comment\": \"详细信息列表。]\"\n                        },\n                        \"type\": \"array\",\n                        \"notnull\": false\n                    }\n                ],\n                \"notnull\": false\n            }\n        }\n    ]\n}','Authorization: Basic Yzk2ZjQyZTBkMmU2NjJlNDVkMDM1YWIxOmRmNGQ1OWU4NGVhYzJmOWQ1M2IzNmYxMg==','2023-04-25 14:57:15','\n# 定时任务 API\n\n\nAPI 层面支持定时功能。\n\n这是一个相对独立的任务执行模块，维护一个 Schedule 对象。\n\n**注：** 调 API 创建的定时任务只能调 API 获取 / 修改 / 删除。\n\n## 调用验证\n\n详情参见 REST API 概述的 [鉴权方式](/zh_CN/docs/app-push/rest-api/rest-api-overview#鉴权方式) 说明。\n## Schedule 参数说明\n\n每一个 schedule 任务，都由 name、enabled、trigger、push 这四个小节组成。\n\n| **参数** | **类型** | **是否可选** | **含义** |\n| --- | --- | --- | --- |\n| name | String | 必填 | 表示 schedule 任务的名字，不得超过 255 字节，由汉字、字母、数字、下划线组成。 |\n| enabled | Boolean | 必填 | 表示任务当前状态，创建任务时必须为 true。 |\n| trigger | JSON Object | 必填 | 定时任务触发时间和触发条件。当前只支持定时任务（single），详情参见 [single 说明](#A5gVk)。 |\n| push | JSON Object | 必填 | 推送内容信息，参考 [app push 文档](/zh_CN/docs/app-push/rest-api/create-push-api) 中各个字段。 |\n\n### single 说明\n\n表示 schedule 任务的触发条件，包含触发时间、定时任务类型。\n\n| **参数** | **类型** | **是否可选** | **含义** |\n| --- | --- | --- | --- |\n| time | String | 必填 | 表示定时任务的触发时间，使用 yyyy-mm-dd hh:mm:ss的标准时间格式表示。如 \"2014-02-15 13:16:59\"，不能为 \"2014-2-15 13:16:59\" 或 \"2014-12-15 13:16\"，即日期时间格式必须完整。定时任务的最晚时间不能超过一年。 |\n| zone_type | Int | 必填 | 表示定时任务的类型，1 表示按照主站设置的时区推送，2 表示按照用户终端所在的时区推送。 |\n\n\n\n## 创建定时任务\n\n### 调用地址\n\n`POST https://push.api.engagelab.cc/v4/schedules`\n\n### 调用限制\n\n- 有效定时任务（当前未过期数）总数默认为 1000 个，超过这个总数后新建定时任务会提示失败。 \n- 定时任务的最大跨度时间不限制，但建议不超过 1 年。\n\n### 请求示例\n**请求报头**\n\n```\nPOST /v4/schedules\n Authorization: Basic (base64 auth string)\n Content-Type: application/json\n Accept: application/json\n```\n\n\n**请求数据**\n\n```json\n{\n    \"name\":\"定时推送示例\",\n    \"enabled\":true,\n    \"trigger\":{\n        \"single\":{\n            \"time\":\"2022-11-23 19:20:00\",\n            \"zone_type\":1\n        }\n    },\n    \"push\":{\n        \"from\":\"push\",\n        \"to\":{\n            \"registration_id\":[\n                \"1a0018970ab49abda3e\",\n                \"100d85590955c1d2793\"\n            ]\n        },\n        \"body\":{\n            \"platform\":\"android\",\n            \"notification\":{\n                \"alert\":\"api终端定时任务\",\n                \"android\":{\n                    \"title\":\"api终端定时任务\",\n                    \"extras\":{\n                        \"key1\":\"value1\"\n                    }\n                }\n            },\n            \"message\":{\n\n            },\n            \"options\":{\n                \"time_to_live\":60\n            }\n        },\n        \"request_id\":\"12345\",\n        \"custom_args\":\"business info\"\n    }\n}\n```\n\n**请求数据说明**\n\n- zone_type 必需填写为指定字段值（1 或 2），否则会按照服务器所在时区进行推送。\n- 定时任务首次创建时其 enabled 项必须为 true。不能创建 enabled:false 的任务，否则创建失败。\n- push 必须为有效合法的 push 动作，否则创建失败。\n\n### 返回示例\n\n**成功返回**\n```bash\n< HTTP/1.1 200 OK\n< Server: fasthttp\n< Date: Thu, 01 Dec 2022 07:17:45 GMT\n< Content-Type: application/json\n< Content-Length: 85\n```\n```bash\n{\n    \"schedule_id\": \"a9b85590-6cec-4f91-b277-2d82b0e20ef6\",\n    \"name\": \"定时任务名称\"\n}\n```\n**失败返回**\n\n```\nHTTP/1.1 400 BAD REQUEST\n Content-Type: application/json; charset=utf-8\n```\n\n```json\n{\n    \"error\": {\n        \"code\": 28400,\n        \"message\": \"error message\"\n    }\n}\n```\n\n## 获取有效的定时任务列表\n\n- 获取当前有效（未过期）的 schedule 列表。\n\n### 调用地址\n\n`GET https://push.api.engagelab.cc/v4/schedules?page=`\n\n### 请求示例\n\n**请求报头**\n\n```\nGET /v4/schedules?page=\n Authorization: Basic (base64 auth string) \n Content-Type: application/json\n Accept: application/json\n```\n\n- 返回当前请求页的详细的 schedule-task 列表，如未指定 page 则 page 为 1。\n- 排序规则：创建时间，由 schedule-service 完成。\n- 如果请求页数大于总页数，则 page 为请求值，schedules 为空。\n- 每页最多返回 50 个 task，如请求页实际的 task 的个数小于 50，则返回实际数量的 task。\n\n### 返回示例\n\n**成功返回**\n\n```\nHTTP/1.1 200 OK \n Content-Type: application/json; charset=utf-8\n```\n\n```json\n{\n    \"total_count\": 1000, // 表示总数\n    \"total_pages\": 5, // 总页数。\n    \"page\": 4, // 当前为第四页。\n    \"schedules\": [\n        {\n            \"schedule_id\": \"0eac1b80-c2ac-4b69-948b-c65b34b96512\",\n            \"name\": \"\",\n            \"enabled\":ture\n        },\n        {}, // 详细信息列表。]\n    }\n```\n\n- 以上表示总共 1000 个 schedule-task，总共 5 页，当前为第 4 页，包含 50 个 schedule-task 的信息。\n- 返回的 schedules 为 schedule-task 的详细信息列表。\n\n## 获取定时任务详情\n\n- 获取当前用户的 schedule 任务 id 为 {schedule_id} 的定时任务的详情。\n### 调用地址\n\n`GET https://push.api.engagelab.cc/v4/schedules/{schedule_id}`\n\n### 请求示例\n\n**请求报头**\n\n```\nGET /v4/schedules/{schedule_id}\n Authorization: Basic (base64 auth string)\n Content-Type: application/json\n Accept: application/json\n```\n\n\n### 返回示例\n\n**成功返回**\n\n```\nHTTP/1.1 200 OK \n Content-Type: application/json; charset=utf-8\n```\n\n**返回数据**\n\n```json\n{\n    \"schedule_id\": \"0eac1b80-c2ac-4b69-948b-c65b34b96512\",\n    \"name\": \"定时推送示例\",\n    \"enabled\": true,\n    \"trigger\": {...},\n    \"push\": {...}\n}\n```\n\n- 如 schedule_id 不存在，则返回 404，否则返回实际 schedule-task 的详情。\n\n## 获取某个定时任务的所有消息 id\n\n- 获取当前用户的 schedule 任务 id 为 {schedule_id} 对应的所有消息 id 列表。\n### 调用地址\n\n`GET https://push.api.engagelab.cc/v4/schedules/{schedule_id}/msg-ids`\n\n### 请求示例\n\n**请求报头**\n\n```\nGET /v4/schedules/{schedule_id}/msg_ids\n Authorization: Basic (base64 auth string)\n Content-Type: application/json\n Accept: application/json\n```\n\n### 返回示例\n\n**成功返回**\n\n```\nHTTP/1.1 200 OK \n Content-Type: application/json; charset=utf-8\n```\n\n**返回数据**\n\n```json\n{\n    \"count\": 3,\n    \"msgids\": [\n        \"12345567\",\n        \"2234567\",\n        \"3234567\"\n    ]\n}\n```\n\n## 更新定时任务\n\n- 更新指定 id 的 schedule 任务。\n### 调用地址\n\n`PUT https://push.api.engagelab.cc/v4/schedules/{schedule_id}`\n\n### 请求示例\n\n```\nPUT /v4/schedules/{schedule_id}\n Authorization: Basic (base64 auth string) \n Content-Type: application/x-www-form-urlencoded\n Accept: application/json\n```\n\n```json\n{\n  \"name\": \"task\", \n  \"enabled\": true, \n  \"trigger\": {...},\n  \"push\": {...} \n}\n```\n\n- 不能更新已过期的 schedule 任务。\n- 按终端时区推送的定时任务与按主站时区推送的定时任务之间不能进行相互更新，反之亦然。\n- 更新操作可为 \"name\"，\"enabled\"、\"trigger\" 或 \"push\" 四项中的一项或多项。不支持部分更新，如更新之前的任务为：\n\n```json\n{\n    \"name\":\"定时推送示例\",\n    \"enabled\":true,\n    \"trigger\":{\n        \"single\":{\n            \"time\":\"2022-11-23 19:20:00\",\n            \"zone_type\":1\n        }\n    },\n    \"push\":{\n        \"from\":\"push\",\n        \"to\":{\n            \"registration_id\":[\n                \"1a0018970ab49abda3e\",\n                \"100d85590955c1d2793\"\n            ]\n        },\n        \"body\":{\n            \"platform\":\"android\",\n            \"notification\":{\n                \"alert\":\"api 终端定时任务\",\n                \"android\":{\n                    \"title\":\"api 终端定时任务\",\n                    \"extras\":{\n                        \"key1\":\"value1\"\n                    }\n                }\n            },\n            \"message\":{\n\n            },\n            \"options\":{\n                \"time_to_live\":60\n            }\n        },\n        \"request_id\":\"12345\",\n        \"custom_args\":\"business info\"\n    }\n}\n```\n\n- 则以下为错误的更新及与之对应的正确的更新示例：\n\n```json\n## WRONG: 更新 push 中的平台为 ios：\n{\n    \"push\": {\n        \"body\": {\n            \"platform\": \"ios\"\n        }\n    }\n}\n## RIGHT: 更新 push 中的平台为 ios：\n{\n    \"push\":{\n        \"from\":\"push\",\n        \"to\":{\n            \"registration_id\":[\n                \"1a0018970ab49abda3e\",\n                \"100d85590955c1d2793\"\n            ]\n        },\n        \"body\":{\n            \"platform\":\"ios\",\n            \"notification\":{\n                \"alert\":\"api 终端定时任务\",\n                \"ios\":{\n                    \"title\":\"api 终端定时任务\",\n                    \"extras\":{\n                        \"key1\":\"value1\"\n                    }\n                }\n            },\n            \"message\":{\n\n            },\n            \"options\":{\n                \"time_to_live\":60\n            }\n        },\n        \"request_id\":\"12345\",\n        \"custom_args\":\"business info\"\n    }\n}\n\n## 此处的 push 更新后必须仍是有效的，否则也会更新失败。\n\n```\n\n### 返回示例\n\n**成功返回**\n\n```\nHTTP/1.0 200 CREATED\n Content-Type: application/json\n```\n\n```json\n{\n    \"name\":\"定时推送示例\",\n    \"enabled\":true,\n    \"trigger\":{\n        \"single\":{\n            \"time\":\"2022-11-23 19:20:00\",\n            \"zone_type\":1\n        }\n    },\n    \"push\":{\n        \"from\":\"push\",\n        \"to\":{\n            \"registration_id\":[\n                \"1a0018970ab49abda3e\",\n                \"100d85590955c1d2793\"\n            ]\n        },\n        \"body\":{\n            \"platform\":\"ios\",\n            \"notification\":{\n                \"alert\":\"api 终端定时任务\",\n                \"ios\":{\n                    \"title\":\"api 终端定时任务\",\n                    \"extras\":{\n                        \"key1\":\"value1\"\n                    }\n                }\n            },\n            \"message\":{\n\n            },\n            \"options\":{\n                \"time_to_live\":60\n            }\n        },\n        \"request_id\":\"12345\",\n        \"custom_args\":\"business info\"\n    }\n}\n```\n\n**失败返回**\n\n- schedule_id 无效，不是有效的 id。\n\n```\nHTTP/1.0 404 Not Found\n Content-Type: application/json\n```\n\n- 更新操作不合法\n\n```\nHTTP/1.0 400 BAD REQUEST\n Content-Type: application/json\n```\n\n## 删除定时任务\n\n### 调用地址\n\n`DELETE https://push.api.engagelab.cc/v4/schedules/{schedule_id}`\n\nschedule_id 为已创建的 schedule 任务的 id，如果 schedule_id 不合法即不是有效的 id，则 404。\n\n### 请求示例\n\n```\nDELETE /v4/schedules/{schedule_id}\n Authorization: Basic (base64 auth string)\n Content-Type: application/json\n Accept: application/json\n```\n\n### 返回示例\n\n**成功返回**\n\n```\nHTTP/1.0 200 \n  Content-Type: application/json\n  Content-Length: 0\n```\n\n**失败返回**\n\n```\nHTTP/1.0 404 Not Found \n  Content-Type: application/json\n  Content-Length: 0\n```\n\n```json\n{\n  \"error\":{\n    \"code\":28404,\n    \"message\":\"error message\"\n  }\n}\n```\n\n## 错误码\n| **Code** | **HTTP** | **描述** | **Error Message** | **详细解释** |\n| --- | --- | --- | --- | --- |\n| 28000 | 200 | 正确返回 | nil | 成功状态码 |\n| 28100 | 400 | 参数无效 | The schedule-task is invalid：section is invalid;has been at term;expired;request data is not json;update target task;Delete target task;schedule request is not exist | <li>参数不合法或者无效。<li>推送超过限制（比如推送广播超限制、定时任务数超限制、定速任务超限制）。<li>参数体超长。|\n| 28101 | 401 | 鉴权失败 | Basic authentication failed. | appkey、masterscrect 不匹配。 |\n| 28104 | 404 | 请求的 schedule 任务不存在 | Request schedule operation doesn\'t exist | 对应的任务已发送，或 schedule id 错误。 |\n| 28105 | 404 | 设置时间无对应推送目标 | The push task is invalid. There is no push target for the scheduled time | push 时间参数错误 |\n| 28200 | 500 | 系统内部错误 | Server Internal error. | 发生未预料错误。 |\n| 28203 | 503 | 系统内部错误，建议稍后重试 | Execute action timeout, please try later again | 与 schedule-server 通信错误。 |'),(1682435153810,0,0,82002,'APIJSON.cn',0,3,NULL,'消息回调 API',NULL,'POST','JSON','/v4/developer_define_url','{\n    \"total\": 1,\n    \"rows\": [\n        {\n            \"message_id\": \"1666165485030094861\",\n            \"from\": \"\",\n            \"to\": \"\",\n            \"server\": \"AppPush\",\n            \"channel\": \"FCM\",\n            \"custom_args\": {},\n            \"itime\": 1640707579,\n            \"status\": {\n                \"message_status\": \"delivered\",\n                \"status_data\": {\n                    \"channel_message_id\": \"wamid.123321abcdefed==\"\n                },\n                \"error_code\": 0,\n                \"error_detail\": {\n                    \"message\": \"\"\n                },\n                \"loss\": {\n                    \"loss_source\": \"vivo\",\n                    \"loss_step\": 1\n                }\n            }\n        }\n    ]\n}',NULL,NULL,'{\n    \"notnull\": true,\n    \"type\": \"object\",\n    \"valueLevel\": 0,\n    \"values\": [\n        {\n            \"total\": {\n                \"notnull\": true,\n                \"type\": \"integer\",\n                \"valueLevel\": 0,\n                \"values\": [\n                    1\n                ],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    1\n                ]\n            },\n            \"rows\": {\n                \"notnull\": true,\n                \"type\": \"array\",\n                \"valueLevel\": 0,\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                  