                 ]\n                                                }\n                                            }\n                                        ]\n                                    }\n                                }\n                            ]\n                        },\n                        \"notnull\": true,\n                        \"type\": \"object\",\n                        \"valueLevel\": 0,\n                        \"values\": [\n                            {\n                                \"message_id\": {\n                                    \"notnull\": true,\n                                    \"type\": \"string\",\n                                    \"valueLevel\": 3,\n                                    \"values\": [],\n                                    \"lengthLevel\": 1,\n                                    \"lengths\": [\n                                        19\n                                    ]\n                                },\n                                \"from\": {\n                                    \"notnull\": true,\n                                    \"type\": \"string\",\n                                    \"valueLevel\": 3,\n                                    \"values\": [],\n                                    \"lengthLevel\": 1,\n                                    \"lengths\": [\n                                        0\n                                    ]\n                                },\n                                \"to\": {\n                                    \"notnull\": true,\n                                    \"type\": \"string\",\n                                    \"valueLevel\": 3,\n                                    \"values\": [],\n                                    \"lengthLevel\": 1,\n                                    \"lengths\": [\n                                        0\n                                    ]\n                                },\n                                \"server\": {\n                                    \"notnull\": true,\n                                    \"type\": \"string\",\n                                    \"valueLevel\": 3,\n                                    \"values\": [],\n                                    \"lengthLevel\": 1,\n                                    \"lengths\": [\n                                        7\n                                    ]\n                                },\n                                \"channel\": {\n                                    \"notnull\": true,\n                                    \"type\": \"string\",\n                                    \"valueLevel\": 0,\n                                    \"values\": [\n                                        \"FCM\"\n                                    ],\n                                    \"lengthLevel\": 1,\n                                    \"lengths\": [\n                                        3\n                                    ]\n                                },\n                                \"custom_args\": {\n                                    \"notnull\": true,\n                                    \"type\": \"object\",\n                                    \"valueLevel\": 0,\n                                    \"values\": [\n                                        {}\n                                    ]\n                                },\n                                \"itime\": {\n                                    \"notnull\": true,\n                                    \"type\": \"integer\",\n                                    \"valueLevel\": 1,\n                                    \"values\": [\n                                        1640707579\n                                    ],\n                                    \"lengthLevel\": 1,\n                                    \"lengths\": [\n                                        10\n                                    ]\n                                },\n                                \"status\": {\n                                    \"notnull\": true,\n                                    \"type\": \"object\",\n                                    \"valueLevel\": 0,\n                                    \"values\": [\n                                        {\n                                            \"message_status\": {\n                                                \"notnull\": true,\n                                                \"type\": \"string\",\n                                                \"valueLevel\": 3,\n                                                \"values\": [],\n                                                \"lengthLevel\": 1,\n                                                \"lengths\": [\n                                                    9\n                                                ]\n                                            },\n                                            \"status_data\": {\n                                                \"notnull\": true,\n                                                \"type\": \"object\",\n                                                \"valueLevel\": 0,\n                                                \"values\": [\n                                                    {\n                                                        \"channel_message_id\": {\n                                                            \"notnull\": true,\n                                                            \"type\": \"string\",\n                                                            \"valueLevel\": 3,\n                                                            \"values\": [],\n                                                            \"lengthLevel\": 1,\n                                                            \"lengths\": [\n                                                                22\n                                                            ]\n                                                        }\n                                                    }\n                                                ]\n                                            },\n                                            \"error_code\": {\n                                                \"notnull\": true,\n                                                \"type\": \"integer\",\n                                                \"valueLevel\": 0,\n                                                \"values\": [\n                                                    0\n                                                ],\n                                                \"lengthLevel\": 1,\n                                                \"lengths\": [\n                                                    1\n                                                ]\n                                            },\n                                            \"error_detail\": {\n                                                \"notnull\": true,\n                                                \"type\": \"object\",\n                                                \"valueLevel\": 0,\n                                                \"values\": [\n                                                    {\n                                                        \"message\": {\n                                                            \"notnull\": true,\n                                                            \"type\": \"string\",\n                                                            \"valueLevel\": 3,\n                                                            \"values\": [],\n                                                            \"lengthLevel\": 1,\n                                                            \"lengths\": [\n                                                                0\n                                                            ]\n                                                        }\n                                                    }\n                                                ]\n                                            },\n                                            \"loss\": {\n                                                \"notnull\": true,\n                                                \"type\": \"object\",\n                                                \"valueLevel\": 0,\n                                                \"values\": [\n                                                    {\n                                                        \"loss_source\": {\n                                                            \"notnull\": true,\n                                                            \"type\": \"string\",\n                                                            \"valueLevel\": 3,\n                                                            \"values\": [],\n                                                            \"lengthLevel\": 1,\n                                                            \"lengths\": [\n                                                                4\n                                                            ]\n                                                        },\n                                                        \"loss_step\": {\n                                                            \"notnull\": true,\n                                                            \"type\": \"integer\",\n                                                            \"valueLevel\": 0,\n                                                            \"values\": [\n                                                                1\n                                                            ],\n                                                            \"lengthLevel\": 1,\n                                                            \"lengths\": [\n                                                                1\n                                                            ]\n                                                        }\n                                                    }\n                                                ]\n                                            }\n                                        }\n                                    ]\n                                }\n                            }\n                        ]\n                    }\n                ]\n            }\n        }\n    ]\n}','Authorization: Basic Yzk2ZjQyZTBkMmU2NjJlNDVkMDM1YWIxOmRmNGQ1OWU4NGVhYzJmOWQ1M2IzNmYxMg==','2023-04-25 15:05:53',NULL),(1682435294373,0,0,82002,'APIJSON.cn',0,3,NULL,'统计 API',NULL,'GET','PARAM','/v4/messages/detail','{\n    \"message_ids\": \"1613113584,1229760629\"\n}',NULL,NULL,'{\n    \"notnull\": true,\n    \"type\": \"object\",\n    \"valueLevel\": 0,\n    \"values\": [\n        {\n            \"message_ids\": {\n                \"notnull\": true,\n                \"type\": \"string\",\n                \"valueLevel\": 3,\n                \"values\": [],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    21\n                ],\n                \"repeat\": 2,\n                \"comment\": \"消息 ID，如果有多个 message_id 时，中间通过\\\",\\\"分割。最多支持 100 个 message_id。\"\n            }\n        }\n    ]\n}','Authorization: Basic Yzk2ZjQyZTBkMmU2NjJlNDVkMDM1YWIxOmRmNGQ1OWU4NGVhYzJmOWQ1M2IzNmYxMg==','2023-04-25 15:08:14','\n# 统计 API \nStats API v4 提供各类统计数据查询功能。\n\n:::\n这是 Stats API 最近的版本。v4 版本的改进为：\n\n- 使用 HTTP Basic Authentication 的方式做访问授权。这样整个 API 请求可以使用常见的 HTTP 工具来完成，比如：curl，浏览器插件等。\n- 推送内容完全使用 JSON 的格式。\n:::\n\n\n## 调用验证\n\n详情参见 REST API 概述的 [鉴权方式](/zh_CN/docs/app-push/rest-api/rest-api-overview#鉴权方式) 说明。\n\n## 消息统计\n\n- 查询 message_id 生命周期中各个状态的统计数据。\n- 每条推送消息的统计数据最多保留一个月。\n\n### 调用地址\n\n`GET https://push.api.engagelab.cc/v4/messages/detail`\n\n### 请求示例\n\n```json\ncurl -v https://push.api.engagelab.cc/v4/status/detail?message_ids=1613113584,1229760629 -u \"7d431e42dfa6a6d693ac2d04:5e987ac6d2e04d95a9d8f0d1\"\n\n< GET /v4/status/detail?message_ids=1613113584,1229760629 HTTP/1.1\n< Authorization: Basic N2Q0MzFlNDJkZmE2YTZkNjkzYWMyZDA0OjVlOTg3YWM2ZDJlMDRkOTVhOWQ4ZjBkMQ==\n```\n\n#### 请求参数\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| message_ids | String | 必选 | <li>消息 ID，如果有多个 message_id 时，中间通过\",\"分割。<li>最多支持 100 个 message_id。|\n\n\n### 返回示例\n\n```json\n< HTTP/1.1 200 OK\n< Content-Type: application/json\n{\n    \"1613113584\": {\n        \"targets\": 11,\n        \"sent\": 11,\n        \"delivered\": 10,\n        \"impressions\": 8,\n        \"clicks\": 2,\n        \"sub\": {\n            \"notification\": {\n                \"target\": 1600,\n                \"sent\": 1440,\n                \"delivered\": 1280,\n                \"impressions\": 1120,\n                \"click\": 0,\n                \"sub_android\": {\n                    \"engageLab_android\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    },\n                    \"huawei\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    },\n                    \"xiaomi\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    },\n                    \"oppo\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    },\n                    \"vivo\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    },\n                    \"meizu\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    },\n                    \"fcm\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    },\n                    \"honor\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    }\n                },\n                \"sub_ios\": {\n                    \"engageLab_ios\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    },\n                    \"apns\": {\n                        \"targets\": 100,\n                        \"sent\": 90,\n                        \"delivered\": 80,\n                        \"impressions\": 70,\n                        \"clicks\": 0\n                    }\n                }\n            },\n            \"message\": {\n                \"targets\": 100,\n                \"sent\": 90,\n                \"delivered\": 80,\n                \"impressions\": 70,\n                \"clicks\": 0,\n            \"sub_android\": {},\n                \"sub_ios\": {}\n            }\n        }\n    },\n    \"1229760629\": {\n        \"targets\": 11,\n        \"sent\": 11,\n        \"delivered\": 10,\n        \"impressions\": 8,\n        \"clicks\": 2,\n        \"sub\": {\n            \"notification\": {},\n            \"message\": {}\n        }\n    }\n}\n```\n\n#### 返回参数\n成功响应为一个 JSON Object，其中 key 为每个 message_id，每个消息需要包含各个阶段的生命周期统计数据：\n\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| targets | Int64 | 必选 | 有效目标。将推送任务所选定的目标人群，经过有效性筛选后的目标设备数量。 |\n| sent | Int64 | 必选 | 发送数量。有效目标设备中，Engagelab 服务器实际成功创建了发送任务的设备数量。 |\n| delivered | Int64 | 必选 | 送达数量。通知消息发送后，实际送达至设备终端的数量，5 天之后的送达数量不被计算在内，华为、魅族和 iOS 需要配置回调送达数据才更加精准。 |\n| impressions | Int64 | 必选 | 展示数量。通知消息送达后，实际在设备终端成功展示的数量，5 天之后的展示数量不被计算在内。 |\n| clicks | Int64 | 必选 | 点击数量。通知消息成功展示后，实际被用户点击的数量，5 天之后的点击数量不被计算在内。 |\n| sub | Object | 必选 | 统计数据的细分指标，详情见 [下表](#细分指标)。<li>notification：通知栏消息类型的数据汇总统计。<li>message：自定义消息的数据汇总统计。 |\n\n##### 细分指标\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| %% sub_android | Object | 可选 | 安卓各个推送通道的数据汇总统计 |\n| %%%engageLab_android | Object | 可选 | 安卓 Engagelab 通道的数据汇总统计 |\n| %%%huawei | Object | 可选 | 华为通道的数据汇总统计 |\n| %%%xiaomi | Object | 可选 | 小米通道的数据汇总统计 |\n| %%%oppo | Object | 可选 | OPPO 通道的数据汇总统计 |\n| %%%vivo | Object | 可选 | vivo 通道的数据汇总统计 |\n| %%%meizu | Object | 可选 | 魅族通道的数据汇总统计 |\n| %%%honor | Object | 可选 | 荣耀通道的数据汇总统计 |\n| %%%fcm | Object | 可选 | FCM 通道的数据汇总统计 |\n| %% sub_ios | Object | 可选 | 苹果各个推送通道的数据汇总统计 |\n| %%% ngageLab_ios | Object | 可选 | iOS Engagelab 通道的数据汇总统计 |\n| %%% apns | Object | 可选 | iOS APNs 通道的数据汇总统计 |\n\n\n## 用户统计\n\n- 提供近 2 个月内某时间段的用户相关统计数据：包括新增用户、在线用户、活跃用户。\n- 时间单位支持：HOUR（小时）、DAY（天）、MONTH（月）。\n\n### 调用地址\n\n`GET https://push.api.engagelab.cc/v4/users`\n\n### 请求示例\n\n```json\ncurl -v https://push.api.engagelab.cc/v4/status/users?time_unit=DAY&start=2014-06-10&duration=3 -u \"7d431e42dfa6a6d693ac2d04:5e987ac6d2e04d95a9d8f0d1\"\n\n< GET /v4/status/users?time_unit=DAY&start=2014-06-10&duration=3 HTTP/1.1\n< Authorization: Basic N2Q0MzFlNDJkZmE2YTZkNjkzYWMyZDA0OjVlOTg3YWM2ZDJlMDRkOTVhOWQ4ZjBkMQ==\n```\n\n#### 请求参数\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| time_unit | String | 必选 | 时间单位。有三个取值：<li>HOUR：小时<li>DAY：天<li>MONTH：月|\n| start | String | 必选 | 起始时间。<li>如果单位是小时，则起始时间是小时（包含天，不足两位要补 0），格式例：2022-06-11T09<li>如果单位是天，则起始时间是日期（天），格式例：2022-06-11<li>如果单位是月，则起始时间是日期（月），格式例：2022-06|\n| duration | String | 必选 | 持续时长。<li>如果单位是天，则是持续的天数。以此类推。<li>只支持查询 60 天以内的用户信息，对于 time_unit 为 HOUR 的，只支持输出当天的统计结果。|\n\n\n### 返回示例\n\n```json\n< HTTP/1.1 200 OK\n< Content-Type: application/json\n{\n    \"time_unit\": \"DAY\",\n    \"start\": \"2014-06-10\",\n    \"duration\": 3,\n    \"items\": [\n        {\n            \"time\": \"2014-06-12\",\n            \"android\": {\n                \"new\": 1,\n                \"active\": 1,\n                \"online\": 2\n            },\n            \"ios\": {\n                \"new\": 1,\n                \"active\": 1,\n                \"online\": 2\n            }\n        }\n    ]\n}\n```\n\n#### 返回参数\n\n成功响应为一个 JSON Object：\n\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| time_unit | String | 必选 | 时间单位。有三个取值：<li>HOUR：小时<li>DAY：天<li>MONTH：月|\n| start | String | 必选 | 起始时间。<li>如果单位是小时，则起始时间是小时（包含天，不足两位要补 0），格式例：2022-06-11 09<li>如果单位是天，则起始时间是日期（天），格式例：2022-06-11<li>如果单位是月，则起始时间是日期（月），格式例：2022-06|\n| duration | String | 必选 | 持续时长。<li>如果单位是天，则是持续的天数。以此类推。<li>只支持查询 60 天以内的用户信息，对于 time_unit 为 HOUR 的，只支持输出当天的统计结果。|\n| items | JSON Array | 必选 | 按持续时间查询范围内的统计结果 |\n\n- items 格式说明：\n   - android：安卓平台的数据汇总统计。\n   - ios：苹果平台的数据汇总统计。\n\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| new | Int64 | 可选 | 新增用户 |\n| online | Int64 | 可选 | 在线用户 |\n| active | Int64 | 可选 | 活跃用户 |\n\n\n## 查询消息生命周期状态\n\n- 查询 message_id 下对应设备的消息生命周期状态。\n- 每条推送消息的统计数据最多保留一个月。\n\n### 调用地址\n\n`GET https://push.api.engagelab.cc/v4/status`\n\n### 请求示例\n\n```json\ncurl -v https://push.api.engagelab.cc/v4/status/message?message_id=1613113584&registration_ids=1507bfd3a7c568d4761,1618cfd3a7c568d4761,17259fd3a7c568d4371 -u \"7d431e42dfa6a6d693ac2d04:5e987ac6d2e04d95a9d8f0d1\"\n\n< GET /v4/status/message?message_id=1613113584&registration_ids=1507bfd3a7c568d4761,1618cfd3a7c568d4761,17259fd3a7c568d4371 HTTP/1.1\n< Authorization: Basic N2Q0MzFlNDJkZmE2YTZkNjkzYWMyZDA0OjVlOTg3YWM2ZDJlMDRkOTVhOWQ4ZjBkMQ==\n```\n\n#### 请求参数\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| message_id | String | 必选 | 消息 ID |\n| registration_ids | String | 必选 | <li>设备 ID，如果有多个 registration_id 时，中间通过\",\"分割。<li>最多支持 1000 个 registration_id。|\n\n\n### 返回示例\n\n```json\n< HTTP/1.1 200 OK\n< Content-Type: application/json\n{\n    \"1507bfd3a7c568d4761\": {\n        \"status\": \"plan\"\n    },\n    \"1618cfd3a7c568d4761\": {\n        \"error_message\": \"The `registration_id` does not belong to the appkey\"\n    },\n    \"17259fd3a7c568d4371\": {\n        \"error_message\": \"internal error\"\n    },\n    \"17259fd3a7c568d4xxx\":{\n        \"error_message\": \"regid illegal\"    	\n    }\n}\n```\n\n#### 返回参数\n\n成功响应为一个 JSON Object，包含这条消息下各个 registration_id 的消息当前状态，如果有异常信息，则将信息包含在 error_message 中。\n\n| **关键字** | **类型** | **选项** | **含义** |\n| --- | --- | --- | --- |\n| status | String | 可选 | 取值范围：<li>plan：计划目标<li>target_valid：有效目标<li>target_invalid：无效目标<li>sent：发送；<li>sent_failed：发送失败<li>delivered：送达<li>delivered_failed：送达失败<li>Impression：展示<li>click：点击|\n| error_message | String | 可选 | 错误信息 |\n\n\n## 调用返回\n\n### HTTP 状态码\n\n参考文档：[HTTP-Status-Code](/zh_CN/docs/app-push/rest-api/http-status-code)\n\n### 错误码\n| **Code** | **描述** | **详细解释** | **HTTP Status Code** |\n| --- | --- | --- | --- |\n| 0 | success | 成功 | 200 |\n| 21001 | The method is not supported or url err | 请求方法(GET/POST)错误或者 url 错误(接口不存在) | 404 |\n| 21003 | Parameter value is invalid | 参数值不合法 | 400 |\n| 23001 | Basic authentication failed | HTTP Basic authorization 失败 | 401 |\n| 23002 | Missing parameter! | 缺少了必须的参数 | 400 |\n| 23004 | time_unit value does not match with start! | time_unit 与 start 参数值不匹配 | 400 |\n| 23007 | Only support quering the message_id within 30 days! | 只支持查询 30 天以内的消息信息 | 400 |\n| 23100 | server error | 系统内部错误 | 500 |\n| 27000 | Server response time out, please try again later | 系统内部错误 | 500 |\n| 27201 | msgid 不存在或不属于此 app | msgid 不存在或不属于此 app | 400 |\n'),(1682435910743,0,0,82002,'APIJSON.cn',0,3,NULL,'分组推送API',NULL,'POST','JSON','/v4/grouppush','{\n    \"from\": \"push\",\n    \"to\": \"all\",\n    \"body\": {\n        \"platform\": \"all\",\n        \"notification\": {\n            \"android\": {\n                \"alert\": \"Hi, Push!\",\n                \"title\": \"Send to Android\",\n                \"builder_id\": 1,\n                \"extras\": {\n                    \"newsid\": 321\n                }\n            },\n            \"ios\": {\n                \"alert\": \"Hi, MTPush!\",\n                \"sound\": \"default\",\n                \"badge\": \"+1\",\n                \"extras\": {\n                    \"newsid\": 321\n                }\n            }\n        },\n        \"message\": {\n            \"msg_content\": \"Hi,MTPush\",\n            \"content_type\": \"text\",\n            \"title\": \"msg\",\n            \"extras\": {\n                \"key\": \"value\"\n            }\n        },\n        \"options\": {\n            \"time_to_live\": 60,\n            \"apns_production\": false\n        }\n    },\n    \"request_id\": \"12345678\",\n    \"custom_args\": \"business info\"\n}',NULL,NULL,'{\n    \"notnull\": true,\n    \"type\": \"object\",\n    \"valueLevel\": 0,\n    \"values\": [\n        {\n            \"from\": {\n                \"notnull\": true,\n                \"type\": \"string\",\n                \"valueLevel\": 3,\n                \"values\": [],\n                \"lengthLevel\