pe\": \"string\",\n                                                    \"valueLevel\": 3,\n                                                    \"values\": [],\n                                                    \"lengthLevel\": 1,\n                                                    \"lengths\": [\n                                                        9\n                                                    ],\n                                                    \"comment\": \"String, 通知内容：这里指定后会覆盖上级统一指定的 alert 信息。内容可以为空字符串，表示不展示到通知栏。各推送通道对此字段的限制详见 推送限制。\"\n                                                },\n                                                \"title\": {\n                                                    \"notnull\": true,\n                                                    \"type\": \"string\",\n                                                    \"valueLevel\": 3,\n                                                    \"values\": [],\n                                                    \"lengthLevel\": 1,\n                                                    \"lengths\": [\n                                                        15\n                                                    ],\n                                                    \"comment\": \"String? 通知标题：如果指定了，则通知里原来展示 App 名称的地方，将展示 title。各推送通道对此字段的限制详见 推送限制 。\"\n                                                },\n                                                \"builder_id\": {\n                                                    \"notnull\": true,\n                                                    \"type\": \"integer\",\n                                                    \"valueLevel\": 0,\n                                                    \"values\": [\n                                                        1\n                                                    ],\n                                                    \"lengthLevel\": 1,\n                                          