                                             \"lengthLevel\": 1,\n                                                        \"lengths\": [\n                                                            22\n                                                        ],\n                                                        \"repeat\": 1\n                                                    },\n                                                    \"phone_number\": {\n                                                        \"notnull\": true,\n                                                        \"type\": \"string\",\n                                                        \"valueLevel\": 3,\n                                                        \"values\": [],\n                                                        \"lengthLevel\": 1,\n                                                        \"lengths\": [\n                                                            13\n                                                        ],\n                                                        \"repeat\": 1\n                                                    }\n                                                }\n                                            ]\n                                        }\n                                    ],\n                                    \"repeat\": 1\n                                }\n                            }\n                        ],\n                        \"components\": {\n                            \"type\": \"array\",\n                            \"notnull\": true,\n                            \"comment\": \"模板具体内容，可包含 HEADER/BODY/FOOTER/BUTTON\"\n                        }\n                    }\n                ],\n                \"repeat\": 1,\n                \"comment\": \"模板具体内容，可包含 HEADER/BODY/FOOTER/BUTTON\"\n            },\n            \"id\": {\n                \"type\": \"string\",\n                \"notnull\": true,\n                \"comment\": \"模板id\"\n            },\n            \"status\": {\n                \"type\": \"string\",\n                \"notnull\": true,\n                \"comment\": \"状态，APPROVED为审核通过可用\"\n            },\n            \"type\": {\n                \"type\": \"string\",\n                \"notnull\": true,\n                \"comment\": \"内容块，目前支持 HEADER/BODY/FOOTER/BUTTONS\"\n            },\n            \"text\": {\n                \"type\": \"string\",\n                \"notnull\": true,\n                \"comment\": \"具体文本，当body为text时不需要传format字段\"\n            },\n            \"format\": {\n                \"type\": \"string\",\n                \"notnull\": true,\n                \"comment\": \"内容类型，支持 text/image/video/document/location\"\n            },\n            \"example\": {\n                \"values\": [\n                    {\n                        \"type\": \"number\",\n                        \"notnull\": false,\n                        \"header_url\": {\n                            \"type\": \"string\",\n                            \"notnull\": true,\n                            \"comment\": \"jiguang.cn/demopic.jpg\\\"]\"\n                        }\n                    }\n                ]\n            }\n        }\n    ]\n}','Authorization: Basic amlndWFuZ2RldjpkZXZfc2VjcmV0 // 上述 base64_auth_string 的生成算法为：base64(dev_key:dev_secret)Header 名称是 \"Authorization\"，值是 base64 转换过的 \"username:password\" 对（中间有个冒号）。在 WhatsApp API 的场景里，username 是 DevKey，password 是 DevSecret。请在控制台-配置管理- API 密钥 页面获取。','2023-04-25 15:18:29','\n## 概述\n使用模板管理 API 可以对 WABA 的模板进行增删改查操作。\n## 调用验证\nEngageLab REST API 采用 [HTTP 基本认证](http://zh.wikipedia.org/wiki/HTTP%E5%9F%BA%E6%9C%AC%E8%AE%A4%E8%AF%81) 的验证方式：HTTP Header（头）里加 Authorization：\n```\nAuthorization: Basic ${base64_auth_string}\n```\n上述 base64_auth_string 的生成算法为：base64(dev_key:dev_secret)\n\n- Header 名称是 \"Authorization\"，值是 base64 转换过的 \"username:password\" 对（中间有个冒号）。\n- 在 WhatsApp API 的场景里，username 是 DevKey，password 是 DevSecret。请在控制台-配置管理- [API 密钥](/zh_CN/docs/whatsapp/console/configuration-management/api-keys) 页面获取。\n## 获取模板\n### 调用地址\n`GET https://wa.api.engagelab.cc/v1/templates`\n### 返回示例\n```\n// 一个 json 数组，数组中每一个对象都是模板信息\n[\n    {\n        \"id\": \"406979728071589\", // 模板id\n        \"name\": \"code\", // 模板名称\n        \"language\": \"zh_CN\", // 模板语言\n        \"status\": \"APPROVED\", // 状态，APPROVED为审核通过可用\n        \"category\": \"OTP\", // 类别，目前支持 OTP/TRANSACTIONAL/MARKETING\n        \"components\": [ // 模板具体内容，可包含 HEADER/BODY/FOOTER/BUTTON\n            {\n                \"type\": \"HEADER\",\n                \"format\": \"text\", // 类型，支持 text/image/location/video/document，默认TEXT\n                \"text\": \"注册验证码\" // 文本内容，当format为text时，为必选项\n            },\n            {\n                \"type\": \"BODY\",\n                \"text\": \"您的验证码是 {{1}}，请于 5 分钟内输入。\" // 两个大括号{{}}括起来的表示模板变量\n            }\n        ]\n    },\n    ......\n]\n```\n### 返回参数\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| id | String | 必填 | 模板 ID |\n| name | String | 必填 | 模板名字 |\n| language | String | 必填 | 模板语言，参见 [语言代码](#语言代码)  。 |\n| category | String | 必填 | 模板类别。<li>OTP：一次性密码<li>MARKETING：市场营销<li>TRANSACTIONAL：交易事务<br />**注意：模板类别最晚在 2023 年 5 月 1 日更新为：**<li>AUTHENTICATION<li>MARKETING<li>UTILITY<br /> |\n| components | Object Array | 必填 | 模板内容的组件，参考 [创建模板中的 components 对象](#components-对象) |\n| status | String | 必填 | 模板状态：<br />APPROVED, IN_APPEAL, PENDING, REJECTED, PENDING_DELETION, DELETED, DISABLED, PAUSED, LIMIT_EXCEEDED |\n\n\n## 创建模板\n### 调用地址\n`POST https://wa.api.engagelab.cc/v1/templates`\n### 调用示例\n```\n{\n    \"name\": \"template_name\", // 模板名称，允许同名模板，仅支持小写字母及数字及下划线\n    \"language\": \"zh_CN\", // 模板语言，同名模板下不允许同语言模板\n    \"category\": \"OTP\", // 类别，目前支持 OTP/TRANSACTIONAL/MARKETING\n    \"components\": [\n        { // 模板内容\n            \"type\": \"BODY\", // 内容块，目前支持 HEADER/BODY/FOOTER/BUTTONS\n            \"text\": \"define var as {{1}}\" // 具体文本，当body为text时不需要传format字段\n      	\"example\": {\n                \"body_text\": [\n                    [\n                        \"var1\"\n                    ]\n                ]\n            }\n        },\n        {\n            \"type\": \"HEADER\",\n            \"format\": \"image\", // 内容类型，支持 text/image/video/document/location\n            \"example\": {\n                \"header_handle\": [\n                    \"https://jiguang.cn/demopic.jpg\"\n                ]\n            }\n        },\n        {\n            \"type\": \"FOOTER\",\n            \"text\": \"footer only support text without variable\"\n        },\n        {\n            \"type\": \"BUTTONS\",\n            \"buttons\": [\n                {\n                    \"type\": \"PHONE_NUMBER\", // 按钮类型，支持 PHONE_NUMBER/URL/QUICK_REPLY              \n                    \"text\": \"this is a phone number\",\n                    \"phone_number\": \"8613800138000\"\n                }\n            ]\n        }\n    ]\n}\n```\n### 请求参数\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| name | String | 必填 | 模版名字，仅支持小写字母、数字及下划线，不超过 512 个字符。 |\n| language | String | 必填 | 模版语言，参见 [语言代码](#语言代码)  。 |\n| category | String | 必填 | 模版类别。<li>OTP：一次性密码<li>MARKETING：市场营销<li>TRANSACTIONAL：交易事务<br />**注意：模板类别最晚在 2023 年 5 月 1 日更新为：**<li>AUTHENTICATION<li>MARKETING<li>UTILITY<br /> |\n| components | Object Array | 必填 | 描述模板内容的组件，参考 [components 对象](#components-对象) 说明；注意必须包含 type=BODY 的 components。 |\n\n#### components 对象\n本对象用于描述模板内容。模板分为「页眉 HEADER」「正文 BODY」「页脚 FOOTER」「按钮 BUTTONS」几个组件，使用 type 来指定，不同的组件类型支持的参数不同，如下：\n##### header 页眉组件\nheader 组件整体是可选的，如果不需要设置页眉，请不要设置此组件\n\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| type | String | 必填 | 组件类型，取值 HEADER |\n| format | String | 必填 | 页眉格式，取值：text、image、video、document，对应着文本、图片、视频、文件。 |\n| text | String | 可选 | 页眉文本内容，当 format=text 时需设置此字段内容。页眉文本内容中可以设置变量，但仅支持设置 1 个变量，用 {{1}} 进行表示。 |\n| example | JSON Object | 可选 | 页眉示例，当 text 包含变量或 format 为媒体类型时，此字段必填。参考 [example 对象说明](#example-对象说明) |\n\n###### example 对象说明\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| header_handle | String Array | 可选 | 当 format 为 image、video、document 时，对此字段传入对应类型的媒体的 url，且 url 能被访问，否则模版审核可能被拒绝。<br />例如：\"header_handle\": [\"`https://jiguang.cn/demopic.jpg`\"] |\n| header_text | String Array | 可选 | 当 format 为 text 且包含变量时，对此字段传入该变量的替换值。例如：\"header_text\": [\"var1\"] |\n| header_url | String Array | 可选 | 与header_handle的用法一致，注意此字段在 WhatsApp  未来的版本中将不再支持，尽量避免使用。<br />例如：\"header_url\": [\"`https://jiguang.cn/demopic.jpg`\"] |\n\n##### body 正文组件\nbody 组件是必填的，必须设置正文内容。\n\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| type | String | 必填 | 组件类型，取值 BODY |\n| text | String | 必填 | 正文内容，最长不超过 个字符，支持设置多个变量，变量由两个大括号加变量序号组成，序号序号需要从 1 开始，保持递增，如 {{1}} 和 {{2}} 。 |\n| example | JSON Object | 可选 | 正文示例，Meta 审核人员将根据示例判断你的消息合规性。参考 [example 对象说明](#example-对象说明-1)，当 text 包含变量时，此字段必填。 |\n\n###### example 对象说明\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| body_text | String Array | 可选 | 当 text 包含变量时，需要对此字段传入**所有变量**的替换值，按变量序号的顺序依次填写。例如：\"body_text\": [[\"var1\",\"var2\",\"var3\"]] |\n\n##### footer 页脚组件\nfooter 组件整体是可选的，如果不需要设置页脚，请不要设置此组件\n\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| type | String | 必填 | 组件类型，取值 FOOTER |\n| text | String | 必填 | 页脚内容，只能设置纯文本内容，**不能定义变量。** |\n\n##### buttons 按钮组件\nbuttons 组件整体是可选的，如果不需要设置按钮，请不要设置此组件\n\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| type | String | 必填 | 组件类型，取值 BUTTONS |\n| buttons | Object Array | 必填 | 按钮信息，参考 [buttons 对象说明](#buttons-对象说明)。 |\n\n###### buttons 对象说明\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| type | String | 必填 | 按钮类型，取值： QUICK_REPLY、URL、PHONE_NUMBER，对应：快速回复、浏览网站、拨打电话号码 |\n| text | String | 必填 | 按钮上的文字说明，**不能包含变量，为纯文本，最长 25 个字符** |\n| url | String | 可选 | 当 type=URL 时必填，可以在网址的结尾设置变量，且仅支持设置 1 个变量，用 {{1}} 进行表示。 |\n| phone_number | String | 可选 | 当 type=PHONE_NUMBER 时必填，**不能包含变量**，内容为包含国际区号的电话号码。 |\n| example | String Array | 可选 | 当 type=QUICK_REPLY 和 type=URL 时必填<br />例如：\"example\": [\"`https://www.website.com/dynamic-url-example`\"] |\n\n### 返回参数\n#### 成功返回\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| template_id | String | 必填 | 模板 ID，成功时返回 |\n\n```\n{\n    \"template_id\": \"1275172986566180\"		// 模板id\n}\n```\n#### 失败返回\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| code | int | 必填 | 错误码，失败时返回 |\n| message | String | 必填 | 错误信息，失败时返回 |\n\n```\n{\n    \"code\": 5002,\n    \"message\": \"Invalid parameter. code:100:2388042\"\n}\n```\n## 更新模板\n### 调用地址\n`PUT  https://wa.api.engagelab.cc/v1/templates/{templateId}`\n### 调用示例\n```\n{\n   \"components\": [{						// 模板内容\n        \"type\": \"BODY\",					// 内容块，目前支持 HEADER/BODY/FOOTER/BUTTONS\n        \"text\": \"define var as {{1}}\" // 具体文本，当body为text时不需要传format字段\n      	\"example\": {\n          	\"body_text\": [[\"var1\"]]\n        }\n    },{\n        \"type\": \"HEADER\",\n        \"format\": \"image\",				// 内容类型，支持 text/image/video/document/location\n      	\"example\": {\n          	\"header_url\": [\"https://jiguang.cn/demopic.jpg\"]\n      	}\n    },{\n				\"type\": \"FOOTER\",\n				\"text\": \"footer only support text without variable\"\n		},{\n      	\"type\": \"BUTTONS\",\n      	\"buttons\": [{                                    \n            \"type\": \"PHONE_NUMBER\",         	// 按钮类型，支持 PHONE_NUMBER/URL/QUICK_REPLY              \n            \"text\": \"this is a phone number\",             \n            \"phone_number\": \"8613800138000\"\n    		}]\n  	}]\n}\n```\n### 请求参数\n同创建模版接口的 [请求参数](/zh_CN/docs/whatsapp/rest-api/send-message-api#请求参数)。\n### 返回参数\n#### 成功返回\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| code | int | 必填 | 返回码，固定为 0 |\n| message | String | 必填 | 返回信息，固定为success |\n\n```\n{\n    \"code\": 0,\n    \"message\": \"success\"\n}\n```\n#### 失败返回\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| code | int | 必填 | 错误码，失败时返回 |\n| message | String | 必填 | 错误信息，失败时返回 |\n\n```\n{\n    \"code\": 5002,\n    \"message\": \"Invalid parameter. code:100:2593002\"\n}\n```\n## 删除模板\n### 调用地址\n`DELETE https://wa.api.engagelab.cc/v1/templates/{template_name}`<br />**注意：此处传递的是模板名称并非模板 ID，将删除该模板名称的所有语言的模板内容**\n### 返回参数\n#### 成功返回\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| code | int | 必填 | 返回码，固定为 0 |\n| message | String | 必填 | 返回信息，固定为success |\n\n```\n{\n    \"code\": 0,\n    \"message\": \"success\"\n}\n\n\n```\n#### 失败返回\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| code | int | 必填 | 错误码，失败时返回 |\n| message | String | 必填 | 错误信息，失败时返回 |\n\n```\n{\n    \"code\": 2004,\n    \"message\": \"something error\"\n}\n```\n## 错误码\n| **错误码** | **http code** | **说明** |\n| --- | --- | --- |\n| 1000 | 500 | 内部错误 |\n| 2001 | 401 | EngageLab 侧鉴权失败，未携带有效数据格式的 token |\n| 2002 | 401 | EngageLab 侧鉴权失败，token已过期或已被禁用 |\n| 2003 | 400 | WhatsApp 侧鉴权失败，请联系 EngageLab 客服处理 |\n| 2004 | 403 | 无调用此 API 的权限 |\n| 3001 | 400 | 请求参数格式无效，请检查是否采用 JSON 格式 |\n| 3002 | 400 | 请求参数有误，请检查请求参数是否符合要求 |\n| 3003 | 400 | 请求参数有误，相关业务校验失败 |\n| 4001 | 400 | 模板不存在 |\n| 5002 | 400 | 模板请求在 Meta 处理失败，详情参考 message 字段的错误描述 |\n\n## 注释\n### 媒体消息格式要求\n| **媒体类型** | **支持的格式类型 Content-Type** | 大小限制 |\n| --- | --- | --- |\n| image | image/jpeg, image/png，不支持透明背景 | 5 MB |\n| video | video/mp4 | 16MB  |\n| document | 仅支持 PDF 格式 | 100 MB |\n\n### 语言代码\n相关语言和对应代码的对应关系，请下载本文件查看：<br />[模板语言代码.xlsx](https://jiguang-docs.yuque.com/attachments/yuque/0/2023/xlsx/22807620/1678245419907-04fb4943-9163-4e9c-b106-4eab82e85a1c.xlsx?_lake_card=%7B%22src%22%3A%22https%3A%2F%2Fjiguang-docs.yuque.com%2Fattachments%2Fyuque%2F0%2F2023%2Fxlsx%2F22807620%2F1678245419907-04fb4943-9163-4e9c-b106-4eab82e85a1c.xlsx%22%2C%22name%22%3A%22%E6%A8%A1%E6%9D%BF%E8%AF%AD%E8%A8%80%E4%BB%A3%E7%A0%81.xlsx%22%2C%22size%22%3A12877%2C%22ext%22%3A%22xlsx%22%2C%22source%22%3A%22%22%2C%22status%22%3A%22done%22%2C%22download%22%3Atrue%2C%22taskId%22%3A%22udb22a932-8729-46db-8e94-c69e0d4a20f%22%2C%22taskType%22%3A%22transfer%22%2C%22type%22%3A%22application%2Fvnd.openxmlformats-officedocument.spreadsheetml.sheet%22%2C%22mode%22%3A%22title%22%2C%22id%22%3A%22ua06120a3%22%2C%22card%22%3A%22file%22%7D)'),(1682436186370,0,0,82002,'APIJSON.cn',0,3,NULL,'消息发送 API',NULL,'POST','JSON','/v1/messages','{\n    \"from\": \"+8613800138000\",\n    \"to\": [\n        \"00447911123456\"\n    ],\n    \"body\": {\n        \"type\": \"template\",\n        \"template\": {\n            \"name\": \"code\",\n            \"language\": \"zh_CN\",\n            \"components\": [\n                {\n                    \"type\": \"body\",\n                    \"parameters\": [\n                        {\n                            \"type\": \"text\",\n                            \"text\": \"12345\"\n                        }\n                    ]\n                }\n            ]\n        },\n        \"image\": {\n            \"id\": \"1\",\n            \"link\": \"https://img.jiguang.cn/jiguang/public/img/c866bd2.png\",\n            \"caption\": \"caption info\"\n        },\n        \"video\": {\n            \"id\": \"1\",\n            \"link\": \"https://img.jiguang.cn/jiguang/public/videos/432acc5.mp4\",\n            \"caption\": \"caption info\"\n        },\n        \"audio\": {\n            \"id\": \"1\",\n            \"link\": \"https://file-examples.com/storage/fe5947fd2362fc197a3c2df/2017/11/file_example_MP3_700KB.mp3\"\n        },\n        \"document\": {\n            \"id\": \"1\",\n            \"link\": \"https://img.jiguang.cn/jiguang/public/videos/432acc5.mp4\",\n            \"caption\": \"caption info\",\n            \"filename\": \"document file name\"\n        },\n        \"sticker\": {\n            \"id\": \"1\",\n            \"link\": \"http://sample-file.bazadanni.com/download/images/webp/sample.webp\"\n        }\n    },\n    \"request_id\": \"123asdbbqwe9faweg\",\n    \"custom_args\": {\n        \"arg1\": \"string val\",\n        \"arg2\": 123\n    }\n}',NULL,NULL,'{\n    \"notnull\": true,\n    \"type\": \"object\",\n    \"valueLevel\": 0,\n    \"values\": [\n        {\n            \"from\": {\n                \"notnull\": true,\n                \"type\": \"string\",\n                \"valueLevel\": 3,\n                \"values\": [],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    14\n                ],\n                \"comment\": \"发送方的电话号码\",\n                \"repeat\": 11\n            },\n            \"to\": {\n                \"notnull\": true,\n                \"type\": \"array\",\n                \"valueLevel\": 0,\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    1\n                ],\n                \"values\": [\n                    {\n                        \"notnull\": true,\n                        \"type\": \"string\",\n                        \"valueLevel\": 3,\n                        \"values\": [],\n                        \"lengthLevel\": 1,\n                        \"lengths\": [\n                            14\n                        ],\n                        \"to\": {\n                            \"type\": \"array\",\n                            \"notnull\": true,\n                            \"comment\": \"收件人的电话号码\"\n                        },\n                        \"repeat\": 11\n                    }\n                ],\n                \"comment\": \"收件人的电话号码\",\n                \"repeat\": 11\n            },\n            \"body\": {\n                \"notnull\": true,\n                \"type\": \"object\",\n                \"valueLevel\": 0,\n                \"values\": [\n                    {\n                        \"type\": {\n                            \"notnull\": true,\n                            \"type\": \"string\",\n                            \"valueLevel\": 3,\n                            \"values\": [],\n                            \"lengthLevel\": 1,\n                            \"lengths\": [\n                                8\n                            ],\n                            \"comment\": \"消息类型\",\n                            \"repeat\": 11\n                        },\n                        \"template\": {\n                            \"notnull\": true,\n                            \"type\": \"object\",\n                            \"valueLevel\": 0,\n                            \"values\": [\n                                {\n                                    \"name\": {\n                                        \"notnull\": true,\n                                        \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            4\n                                        ],\n                                        \"repeat\": 11,\n                                        \"comment\": \"模板名称。可以在控制台-消息模板页面找到，仅支持小写数字及下划线。\"\n                                    },\n                                    \"language\": {\n                                        \"notnull\": true,\n                                        \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            5\n                                        ],\n                                        \"repeat\": 11,\n                                        \"comment\": \"模板 语言代码。创建模板时对同一个模板名称可以设置多个语言的内容，因此发送时需要使用 name 和 language 字段共同决定所选模板。\"\n                                    },\n                