          \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            12\n                                        ],\n                                        \"comment\": \"可选，文件下方的文本描述，1024个字符内\",\n                                        \"repeat\": 7\n                                    },\n                                    \"filename\": {\n                                        \"notnull\": true,\n                                        \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            18\n                                        ],\n                                        \"comment\": \"可选，文件名称\",\n                                        \"repeat\": 7\n                                    },\n                                    \"id\": {\n                                        \"notnull\": true,\n                                        \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            1\n                                        ],\n                                        \"comment\": \"whatsapp 侧的 media_id ；id 和 link 其一必须有值。\",\n                                        \"repeat\": 6\n                                    }\n                                }\n                            ],\n                            \"comment\": \"文件消息\"\n                        },\n                        \"sticker\": {\n                            \"notnull\": true,\n                            \"type\": \"object\",\n                            \"valueLevel\": 0,\n                            \"values\": [\n                                {\n                                    \"id\": {\n                                        \"notnull\": true,\n                                        \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            1\n                                        ],\n                                        \"comment\": \"whatsapp 侧的 media_id ；id 和 link 其一必须有值。\",\n                                        \"repeat\": 6\n                                    },\n                                    \"link\": {\n                                        \"notnull\": true,\n                                        \"type\": \"string\",\n                                        \"valueLevel\": 3,\n                                        \"values\": [],\n                                        \"lengthLevel\": 1,\n                                        \"lengths\": [\n                                            65\n                                        ],\n                                        \"comment\": \"sample-file.bazadanni.com/download/images/webp/sample.webp\\\"\",\n                                        \"repeat\": 6\n                                    }\n                                }\n                            ],\n                            \"comment\": \"贴纸消息\"\n                        }\n                    }\n                ],\n                \"comment\": \"消息内容\"\n            },\n            \"request_id\": {\n                \"notnull\": true,\n                \"type\": \"string\",\n                \"valueLevel\": 3,\n                \"values\": [],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    17\n                ],\n                \"repeat\": 11,\n                \"comment\": \"自定义的请求 ID，用来标识是哪条请求，响应时返回。\"\n            },\n            \"custom_args\": {\n                \"notnull\": true,\n                \"type\": \"object\",\n                \"valueLevel\": 0,\n                \"values\": [\n                    {\n                        \"arg1\": {\n                            \"notnull\": true,\n                            \"type\": \"string\",\n                            \"valueLevel\": 3,\n                            \"values\": [],\n                            \"lengthLevel\": 1,\n                            \"lengths\": [\n                                10\n                            ],\n                            \"repeat\": 11\n                        },\n                        \"arg2\": {\n                            \"notnull\": true,\n                            \"type\": \"integer\",\n                            \"valueLevel\": 0,\n                            \"values\": [\n                                123\n                            ],\n                            \"lengthLevel\": 1,\n                            \"lengths\": [\n                                3\n                            ],\n                            \"repeat\": 22,\n                            \"trend\": {\n                                \"top\": 11\n                            }\n                        }\n                    }\n                ],\n                \"comment\": \"自定义的信息，在消息状态回调中返回给开发者。\"\n            }\n        }\n    ]\n}','Authorization: Basic amlndWFuZ2RldjpkZXZfc2VjcmV0','2023-04-25 15:23:06','\n使用消息发送 API 可以将 WhatsApp 的消息发送能力集成到你的业务系统中。<br />在调用 API 之前，请先在控制台 [API 密钥](/zh_CN/docs/whatsapp/console/configuration-management/api-keys) 页面创建密钥。 \n## 调用地址\n`POST https://wa.api.engagelab.cc/v1/messages`\n## 调用验证\nEngageLab REST API 采用 [HTTP 基本认证](http://zh.wikipedia.org/wiki/HTTP%E5%9F%BA%E6%9C%AC%E8%AE%A4%E8%AF%81) 的验证方式：HTTP Header（头）里加 Authorization：\n```\nAuthorization: Basic ${base64_auth_string}\n```\n上述 base64_auth_string 的生成算法为：base64(dev_key:dev_secret)\n\n- Header 名称是 \"Authorization\"，值是 base64 转换过的 \"username:password\" 对（中间有个冒号）。\n- 在 WhatsApp API 的场景里，username 是 DevKey，password 是 DevSecret。请在控制台-配置管理- [API 密钥](/zh_CN/docs/whatsapp/console/configuration-management/api-keys) 页面获取。\n## 请求示例\n### 请求头\n```json\nPOST /v1/messages  \nHTTP/1.1  Content-Type: application/json  \nAuthorization: Basic amlndWFuZ2RldjpkZXZfc2VjcmV0\n```\n### 请求体\n```json\n {\n    \"from\": \"+8613800138000\",\n    \"to\": [\n        \"00447911123456\"\n    ],\n    \"body\": {\n        \"type\": \"template\",\n        \"template\": {\n            \"name\": \"code\",\n            \"language\": \"zh_CN\",\n            \"components\": [\n                {\n                    \"type\": \"body\",\n                    \"parameters\": [\n                        {\n                            \"type\": \"text\",\n                            \"text\": \"12345\"\n                        }\n                    ]\n                }\n            ]\n        }\n    },\n    \"request_id\": \"123asdbbqwe9faweg\",\n    \"custom_args\": {\n        \"arg1\": \"string val\",\n        \"arg2\": 123\n    }\n}\n```\n## 请求参数\n一个请求对象以 JSON 格式表达，因此请求头需要带 Content-Type: application/json 。\n\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| from | String | 选填 | 发送号 |\n| to | String Array | 必填 | 发送目标的电话号码 |\n| body | JSON Object | 必填 | 消息体 |\n| request_id | String | 选填 | 自定义的请求 ID，用来标识是哪条请求，响应时返回。 |\n| custom_args | JSON Object | 选填 | 自定义的信息，在消息状态回调中返回给开发者。 |\n\n### from\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| from | String | 选填 | 发送号，即用于发送消息的企业电话号码。<br />需要加上国际区号，未填写时使用默认发送号（需要在 [控制台配置](/zh_CN/docs/whatsapp/console/configuration-management/sending-numbers#设为默认)） |\n\n### to\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| to | String Array | 必填 | 发送目标的 WhatsApp 电话号码，需要加上国际区号 |\n\n### body\n一个消息体，包含的字段如下：\n\n| **参数** | **类型** | **选项** | **说明** |\n| --- | --- | --- | --- |\n| type | string | 必填 | 消息类型，目前支持：<li>template： 模板消息<li>text： 文本消息<li>image： 图片消息<li>audio： 音频消息<li>video： 视频消息<li>document： 文档消息<li>sticker： 贴纸消息<br />**仅 template 消息才能主动发送给用户**，其余类型的消息要求用户在 24 小时内回复过消息，才能被送达。<br />其中 图片/音频/视频/文档/贴纸 皆为媒体消息，注意遵循 [媒体消息格式要求](#媒体消息格式要求)。  |\n| template | template object | 可选 | 当 type=template 时使用，详见 [template object 说明](#template-object-说明)。 |\n| text | text object | 可选 | 当 type=text 时使用，详见 [text object 说明](#text-object-说明) |\n| image | image object | 可选 | 当 type=image 时使用，详见 [image object 说明](#image-object-说明)。 |\n| audio | audio object | 可选 | 当 type=audio 时使用，详见 [audio object 说明](#audio-object-说明)。 |\n| video | video object | 可选 | 当 type=video 时使用，详见 [video object 说明](#video-object-说明)。 |\n| document | document object | 可选 | 当 type=document 时使用，详见 [document object 说明](#document-object-说明)。 |\n| sticker | sticker object | 可选 | 当 type=sticker 时使用，详见 [sticker object 说明](#sticker-object-说明)。|\n\n#### text object 说明\n文本消息\n\n| **参数** | **类型** | 选项 | **说明** |\n| --- | --- | --- | --- |\n| body | String | 必填 | 文本内容，WhatsApp 要求不超过 4096 个字符/character |\n\n**示例**\n```\n{\n    \"from\": \"8613800138000\", //发送方的电话号码\n    \"to\": [\"8613800138000\"], //收件人的电话号码\n    \"body\": {\n        \"type\": \"text\", //消息类型\n        \"text\": {\n            \"body\": \"your-text-message-content\" //消息内容\n        }\n    }\n}\n```\n#### image object 说明\n图片消息\n\n| **参数** | **类型** | 选项 | **说明** |\n| --- | --- | --- | --- |\n| id | String | 可选 | WhatsApp 生成的 media_id ；id 和 link 其一必须有值。 |\n| link | String | 可选 | 图片链接，http/https 链接，注意遵循 [媒体消息格式要求](#媒体消息格式要求)。  |\n| caption | String | 可选 | 对图片的描述，不超过 1024 个字符。 |\n\n**示例**\n```\n{\n    \"from\": \"8613800138000\",//发送方的电话号码\n    \"to\": [\"8613800138000\"], //收件人的电话号码\n	\"body\": {			\n			\"type\": \"image\",//消息类型\n			\"image\": {\n				\"link\": \"https://img.jiguang.cn/jiguang/public/img/c866bd2.png\", //图片链接\n        \"caption\": \"caption info\"   // 可选，图片下方的文本描述，1024个字符内\n			}\n	}\n}\n```\n#### video object 说明\n视频消息\n\n| **参数** | **类型** | 选项 | **说明** |\n| --- | --- | --- | --- |\n| id | String | 可选 | WhatsApp 生成的 media_id ；id 和 link 其一必须有值。 |\n| link | String | 可选 | 视频链接，http/https 链接，注意遵循 [媒体消息格式要求](#媒体消息格式要求)。  |\n| caption | String | 可选 | 对视频的描述，不超过 1024 个字符。 |\n\n**示例**\n```\n{\n    \"from\": \"8613800138000\",//发送方的电话号码\n    \"to\": [\"8613800138000\"], //收件人的电话号码\n	\"body\": {			\n			\"type\": \"video\",//消息类型\n			\"video\": {\n				\"link\": \"https://img.jiguang.cn/jiguang/public/videos/432acc5.mp4\", //视频链接\n        \"caption\": \"caption info\"   // 可选，视频下方的文本描述，1024个字符内\n			}\n	}\n}\n```\n#### audio object 说明\n音频消息\n\n| **参数** | **类型** | 选项 | **说明** |\n| --- | --- | --- | --- |\n| id | String | 可选 | WhatsApp 生成的 media_id ；id 和 link 其一必须有值。 |\n| link | String | 可选 | 音频链接，http/https 链接，注意遵循 [媒体消息格式要求](#媒体消息格式要求)。  |\n\n**示例**\n```\n{\n    \"from\": \"8613800138000\",//发送方的电话号码\n    \"to\": [\"8613800138000\"], //收件人的电话号码\n	\"body\": {\n			\"type\": \"audio\",//消息类型\n			\"audio\": {\n				\"link\": \"https://file-examples.com/storage/fe5947fd2362fc197a3c2df/2017/11/file_example_MP3_700KB.mp3\" //音频链接\n			}\n	}\n}\n```\n#### document object 说明\n文件消息\n\n| **参数** | **类型** | 选项 | **说明** |\n| --- | --- | --- | --- |\n| id | String | 可选 | WhatsApp 生成的 media_id ；id 和 link 其一必须有值。 |\n| link | String | 可选 | 文档链接，http/https 链接，注意遵循 [媒体消息格式要求](#媒体消息格式要求)。  |\n| caption | String | 可选 | 对文件的描述，不超过 1024 个字符。 |\n| filename | String | 可选 | 文件名称。若未填写`filename`字段而填写了`caption`字段，则会以`caption`作为文件名；若填写了`filename`则会以`filename`的值作为文件名。 |\n\n**示例**\n```\n{\n    \"from\": \"8613800138000\",//发送方的电话号码\n    \"to\": [\"8613800138000\"], //收件人的电话号码\n	\"body\": {\n			\"type\": \"document\",//消息类型\n			\"document\": {\n				\"link\": \"https://img.jiguang.cn/jiguang/public/videos/432acc5.mp4\", //文件链接\n        \"caption\": \"caption info\",   // 可选，文件下方的文本描述，1024个字符内\n        \"filename\": \"document file name\"    // 可选，文件名称\n			}\n	}\n}\n```\n#### sticker object 说明\n贴纸消息\n\n| **参数** | **类型** | 选项 | **说明** |\n| --- | --- | --- | --- |\n| id | String | 可选 | whatsapp 侧的 media_id ；id 和 link 其一必须有值。 |\n| link | String | 可选 | 贴纸链接，http/https 链接，注意遵循 [媒体消息格式要求](#媒体消息格式要求)。  |\n\n**示例**\n```\n{\n    \"from\": \"8613800138000\",//发送方的电话号码\n    \"to\": [\"8613800138000\"], //收件人的电话号码\n	\"body\": {\n			\"type\": \"sticker\",//消息类型\n			\"sticker\": {\n				\"link\": \"http://sample-file.bazadanni.com/download/images/webp/sample.webp\" //贴纸链接\n			}\n	}\n}\n```\n\n#### template object 说明\n模板消息，需要先创建模板，可以在 [控制台操作](/zh_CN/docs/whatsapp/console/message-center/message-templates) 或 [调用 API 创建](/zh_CN/docs/whatsapp/rest-api/template-management-api) 。\n\n| **参数** | **类型** | **类型** | **说明** |\n| --- | --- | --- | --- |\n| name | String | 必填 | 模板名称。可以在控制台-消息模板页面找到，仅支持小写数字及下划线。 |\n| language | String | 必填 | 模板 [语言代码](https://developers.facebook.com/docs/whatsapp/api/messages/message-templates#language)。创建模板时对同一个模板名称可以设置多个语言的内容，因此发送时需要使用 name 和 language 字段共同决定所选模板。 |\n| components | components-object array | 可选 | 当模板中存在可变变量时，需要填充此字段，数组中仅设置 1 个 components 对象元素即可。 |\n\n##### template.components object 说明\n| **参数** | **类型** | 选项 | **说明** |\n| --- | --- | --- | --- |\n| type | String | 必填 | 模板组件，模板中哪一个组件包含变量，就需要对该组件传值，取值：<li>header：页眉<li>body：正文<li>footer：页脚<li>button：按钮<br /> |\n| parameters | parameters object | 必填 | 设置可变变量内容 |\n\n##### template.components.parameters object 说明\n| **参数** | **类型** | 选项 | **说明** |\n| --- | --- | --- | --- |\n| type | string | 必填 | 变量内容的类型，取值 text、currency、date_time、image、video、document。多媒体素材类型（image、video、document）仅在页眉（header）中存在，素材支持的格式请参考 [媒体消息格式要求](#媒体消息格式要求) 。 |\n| text | string | 可选 | 当 type=text 时使用，为可变变量的具体内容 |\n| date_time | localizable object | 可选 | 当 type=date_time 时使用，与 text 区别在于可本地化适配显示。 |\n| currency | localizable object | 可选 | 当 type=currency 时使用，与 text 区别在于可本地化适配显示。 |\n| image | image object | 可选 | 当 type=image 时使用，与 [image object](#image-object-说明) 内容格式一致。 |\n| video | video object | 可选 | 当 type=video 时使用，与 [video object](#video-object-说明) 内容格式一致。 |\n| document | document object | 可选 | 当 type=document 时使用，与 [document object](#document-object-说明) 内容格式一致。 |\n\n\n**示例**\n```json\n{\n    \"from\": \"+8613800138000\",\n    \"to\": [\n        \"00447911123456\"\n    ],\n    \"body\": {\n        \"type\": \"template\",\n        \"template\": {          \n            \"name\": \"your-template-name\",\n						\"language\": \"zh_CN\",\n            \"components\": [\n              {\n                \"type\" : \"header\",\n                \"parameters\": [{\n                         \"type\": \"document\",\n                         \"document\": {\n                             \"link\": \"http(s)://the-url\",\n                             \"filename\": \"your-document-filename\"\n                       }\n                }]\n              },\n              {\n                 \"type\": \"body\",\n                 \"parameters\": [\n                        {\n                            \"type\": \"text\",\n                            \"text\": \"your-text-string\"\n                        },\n                        {\n                            \"type\": \"currency\",\n                            \"currency\": {\n                                \"fallback_value\": \"$100.99\",\n                                \"code\": \"USD\",\n                                \"amount_1000\": 100990\n                            }\n                        },\n                        {\n                            \"type\": \"date_time\",\n                            \"date_time\": {\n                                \"fallback_value\": \"February 25, 1977\",\n                                \"day_of_week\": 5,\n                                \"day_of_month\": 25,\n                                \"year\": 1977,\n                                \"month\": 2,\n                                \"hour\": 15,\n                                \"minute\": 33\n                            }\n                        },\n                        {\n                            \"type\": \"date_time\",\n                            \"date_time\": {\n                                \"fallback_value\": \"February 25, 1977\",\n                                \"timestamp\": 1485470276\n                            }\n                        }\n                    ]\n                }\n            ]\n        }\n    }\n}\n```\n## 返回参数\n### 成功返回\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| message_id | String | 必选 | EngageLab WhatsApp 的消息 ID，唯一标识某一条消息。 |\n| request_id | String | 可选 | 请求时提交的自定义 ID，响应时原样返回。 |\n\n```\n{\n	\"message_id\": \"cbggf4if6o9ukqaalfug\",\n	\"request_id\": \"your-sendno-string\"\n}\n```\n### 失败返回\nhttp 状态码为 4xx 或者 5xx，响应体包含字段如下：\n\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| code | int | 必选 | 错误码，详见 [错误码](#错误码) 说明 |\n| message | String | 必选 | 错误详情 |\n\n```\n{\n	\"code\": 3002,\n	\"message\": \"whatsapp.template field must be set correctly when type is template\"\n}\n```\n## 错误码\n| **错误码** | **http code** | **说明** |\n| --- | --- | --- |\n| 1000 | 500 | 内部错误 |\n| 2001 | 401 | EngageLab 侧鉴权失败，未携带有效数据格式的 token。 |\n| 2002 | 401 | EngageLab 侧鉴权失败，token已过期或已被禁用。 |\n| 2003 | 400 | WhatsApp 侧鉴权失败，请联系 EngageLab 客服处理 。|\n| 2004 | 403 | 无调用此 API 的权限，请检查您是否有对该 API 秘钥授权了消息发送 API （某发送号）的权限。 |\n| 3001 | 400 | 请求参数格式无效，请检查是否采用 JSON 格式。 |\n| 3002 | 400 | 请求参数有误，请检查请求参数是否符合要求。 |\n| 3003 | 400 | 请求参数有误，相关业务校验失败，详情参考 message 字段的错误描述。 |\n| 4001 | 400 | 相关资源不存在，如模版消息下发时使用了不存在的模版。 |\n\n## 注释\n### 媒体消息格式要求\n| **媒体类型** | **支持的格式类型 Content-Type** | 大小限制 |\n| --- | --- | --- |\n| image | image/jpeg, image/png，不支持透明背景 | 5 MB |\n| video | video/mp4, video/3gpp<br />注：编码上仅支持 H.264 视频编码和 AAC 音频编码 | 16MB  |\n| audio | audio/aac, audio/mp4, audio/amr, audio/mpeg, <br />audio/ogg; codecs=opus（注：基础的 audio/ogg 不支持，仅支持 audio/ogg; codecs=opus） | 16MB |\n| document | 1、发送文件消息时，支持任何的 MIME-type 类型<br />2、发送模板消息时，页眉中的文件仅支持 PDF 格式 | 100 MB |\n| sticker | image/webp | Static stickers:100KB<br />Animated stickers: 500KB<br />512x512 像素 |\n\n### 语言代码\n相关语言和对应代码的对应关系，请下载本文件查看：<br />[模板语言代码.xlsx](https://jiguang-docs.yuque.com/attachments/yuque/0/2023/xlsx/22807620/1678169411547-ecc7b449-3d5a-429c-ad7a-96dae3c3284b.xlsx?_lake_card=%7B%22src%22%3A%22https%3A%2F%2Fjiguang-docs.yuque.com%2Fattachments%2Fyuque%2F0%2F2023%2Fxlsx%2F22807620%2F1678169411547-ecc7b449-3d5a-429c-ad7a-96dae3c3284b.xlsx%22%2C%22name%22%3A%22%E6%A8%A1%E6%9D%BF%E8%AF%AD%E8%A8%80%E4%BB%A3%E7%A0%81.xlsx%22%2C%22size%22%3A12877%2C%22ext%22%3A%22xlsx%22%2C%22source%22%3A%22%22%2C%22status%22%3A%22done%22%2C%22download%22%3Atrue%2C%22taskId%22%3A%22ud74a0dec-0013-4792-b890-10f5fb9e6fc%22%2C%22taskType%22%3A%22upload%22%2C%22type%22%3A%22application%2Fvnd.openxmlformats-officedocument.spreadsheetml.sheet%22%2C%22__spacing%22%3A%22both%22%2C%22mode%22%3A%22title%22%2C%22id%22%3A%22ua06120a3%22%2C%22margin%22%3A%7B%22top%22%3Atrue%2C%22bottom%22%3Atrue%7D%2C%22card%22%3A%22file%22%7D)'),(1682437178141,0,0,82002,'APIJSON.cn',0,3,NULL,'消息回调 API',NULL,'POST','JSON','/v1/jpush','{\n    \"total\": 1,\n    \"rows\": [\n        {\n            \"message_id\": \"1666165485030094861\",\n            \"from\": \"\",\n            \"to\": \"\",\n            \"server\": \"whatsapp\",\n            \"channel\": \"whatsapp\",\n            \"itime\": 1640707579,\n            \"custom_args\": {},\n            \"status\": {\n                \"message_status\": \"delivered\",\n                \"status_data\": {\n                    \"msg_time\": 1663432355,\n                    \"channel_message_id\": \"wamid.123321abcdefed==\",\n                    \"whatsapp_business_account_id\": \"\",\n                    \"timezone\": \"\",\n                 