           \"notnull\": false,\n                                    \"message_id\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": true,\n                                        \"comment\": \"极光侧的消息 id\"\n                                    },\n                                    \"from\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": true,\n                                        \"comment\": \"发送方，即客户的手机号码\"\n                                    },\n                                    \"to\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": true,\n                                        \"comment\": \"接收方，即开发者的发送号\"\n                                    },\n                                    \"itime\": {\n                                        \"type\": \"integer\",\n                                        \"notnull\": true,\n                                        \"comment\": \"时间戳\"\n                                    },\n                                    \"custom_args\": {\n                                        \"type\": \"object\",\n                                        \"notnull\": true,\n                                        \"comment\": \"这条消息创建时提交的参数，将于此回调时原样返回\"\n                                    },\n                                    \"status\": {\n                                        \"type\": \"object\",\n                                        \"notnull\": true,\n                                        \"comment\": \"成功时响应这些字段\",\n                                        \"values\": [\n                                            {\n                                                \"0\": {\n                                                    \"type\": \"string\",\n                                                    \"notnull\": true,\n                                                    \"comment\": \"失败状态下（无效目标、发送失败、送达失败、未读）返回这些字段\"\n                                                },\n                                                \"type\": \"number\",\n                                                \"notnull\": false,\n                                                \"message_status\": {\n                                                    \"type\": \"string\",\n                                                    \"notnull\": true,\n                                                    \"comment\": \"消息状态\"\n                                                },\n                                                \"status_data\": {\n                                                    \"type\": \"object\",\n                                                    \"notnull\": true,\n                                                    \"comment\": \"自定义\",\n                                                    \"values\": [\n                                                        {\n                                                            \"type\": \"number\",\n                                                            \"notnull\": false,\n                                                            \"msg_time\": {\n                                                                \"type\": \"integer\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"消息下发时间，历史记录上的消息发送时间，即用户调用 API 发送消息-调用 API 成功的那个时间\"\n                                                            },\n                                                            \"channel_message_id\": {\n                                                                \"type\": \"string\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"可选，Meta 返回的 msgid\"\n                                                            },\n                                                            \"whatsapp_business_account_id\": {\n                                                                \"type\": \"string\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"发送号 from 对应的 Whatsapp 商业账户编码\"\n                                                            },\n                                                            \"timezone\": {\n                                                                \"type\": \"string\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"组织时区\"\n                                                            },\n                                                            \"plan_user_total\": {\n                                                                \"type\": \"integer\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"计划目标总数，只有当 message_status=plan 时这个才会有值\"\n                                                            },\n                                                            \"country_code\": {\n                                                                \"type\": \"string\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"接收方手机号码归属的国家/地区代码\"\n                                                            },\n                                                            \"from_phone_id\": {\n                                                                \"type\": \"string\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"发送号码（from）的 ID 标识\"\n                                                            },\n                                                            \"conversation\": {\n                                                                \"type\": \"object\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"可选，会话信息\",\n                                                                \"values\": [\n                                                                    {\n                                                                        \"type\": \"number\",\n                                                                        \"notnull\": false,\n                                                                        \"id\": {\n                                                                            \"type\": \"string\",\n                                                                            \"notnull\": true,\n                                                                            \"comment\": \"该条消息所属的 Meta 对话 ID\"\n                                                                        },\n                                                                        \"origin\": {\n                                                                            \"type\": \"object\",\n                                                                            \"notnull\": false,\n                                                                            \"comment\": \" 表示是由谁发起的对话。由 type 指定。\",\n                                                                            \"values\": [\n                                                                                {\n                                                                                    \"type\": \"number\",\n                                                                                    \"notnull\": false\n                                                                                }\n                                                                            ]\n                                                                        }\n                                                                    }\n                                                                ]\n                                                            },\n                                                            \"pricing\": {\n                                                                \"type\": \"object\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"可选，价格信息\",\n                                                                \"values\": [\n                                                                    {\n                                                                        \"type\": \"number\",\n                                                                        \"notnull\": false,\n                                                                        \"pricing_model\": {\n                                                                            \"type\": \"string\",\n                                                                            \"notnull\": false,\n                                                                            \"comment\": \" 固定取值为 CBP\"\n                                                                        },\n                                                                        \"category\": {\n                                                                            \"type\": \"string\",\n                                                                            \"notnull\": true,\n                                                                            \"comment\": \"对话定价类别，取值如下：business_initiated：商家对话。customer_initiated： 用户对话。referral_conversion： 免费接入点对话。\"\n                                                                        }\n                                                                    }\n                                                                ]\n                                                            }\n                                                        }\n                                                    ]\n                                                },\n                                                \"error_code\": {\n                                                    \"type\": \"integer\",\n                                                    \"notnull\": true,\n                                                    \"comment\": \"错误码\"\n                                                },\n                                                \"error_detail\": {\n                                                    \"values\": [\n                                                        {\n                                                            \"type\": \"number\",\n                                                            \"notnull\": false,\n                                                            \"message\": {\n                                                                \"type\": \"string\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"错误原因\"\n                                                            }\n                                                        }\n                                                    ]\n                                                },\n                                                \"loss\": {\n                                                    \"values\": [\n                                                        {\n                                                            \"type\": \"number\",\n                                                            \"notnull\": false,\n                                                            \"loss_step\": {\n                                                                \"type\": \"integer\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"折损阶段：1：计划目标 ~ 有效目标，即无效目标。2：有效目标 ~ 发送，即发送失败。3：发送 ~ 送达。即送达失败。\"\n                                                            },\n                                                            \"loss_source\": {\n                                                                \"type\": \"string\",\n                                                                \"notnull\": true,\n                                                                \"comment\": \"折损来源，取值：engagelab：EngageLab WhatsApp 服务进行校验产生的折损。meta：Meta 官方返回的错误。\"\n                                                            }\n                                                        }\n                                                    ]\n                                                }\n                                            }\n                                        ]\n                                    },\n                                    \"server\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": true,\n                                        \"comment\": \"回调信息所属的产品服务，固定取值 whatsapp\"\n                                    },\n                                    \"channel\": {\n                                        \"type\": \"string\",\n                                        \"notnull\": false,\n                                        \"comment\": \" 