\"type\": {\n                                                                                    \"notnull\": true,\n                                                                                    \"type\": \"string\",\n                                                                                    \"valueLevel\": 3,\n                                                                                    \"values\": [],\n                                                                                    \"lengthLevel\": 1,\n                                                                                    \"lengths\": [\n                                                                                        18\n                                                                                    ],\n                                                                                    \"repeat\": 7\n                                                                                }\n                                                                            }\n                                                                        ]\n                                                                    }\n                                                                }\n                                                            ]\n                                                        },\n                                                        \"pricing\": {\n                                                            \"notnull\": true,\n                                                            \"type\": \"object\",\n                                                            \"valueLevel\": 0,\n                                                            \"values\": [\n                                                                {\n                                                                    \"pricing_model\": {\n                                                                        \"notnull\": true,\n                                                                        \"type\": \"string\",\n                                                                        \"valueLevel\": 0,\n                                                                        \"values\": [\n                                                                            \"CBP\"\n                                                                        ],\n                                                                        \"lengthLevel\": 1,\n                                                                        \"lengths\": [\n                                                                            3\n                                                                        ],\n                                                                        \"repeat\": 14\n                                                                    },\n                                                                    \"category\": {\n                                                                        \"notnull\": true,\n                                                                        \"type\": \"string\",\n                                                                        \"valueLevel\": 3,\n                                                                        \"values\": [],\n                                                                        \"lengthLevel\": 1,\n                                                                        \"lengths\": [\n                                                                            18\n                                                                        ],\n                                                                        \"repeat\": 7\n                                                                    }\n                                                                }\n                                                            ]\n                                                        }\n                                                    }\n                                                ]\n                                            },\n                                            \"error_code\": {\n                                                \"notnull\": true,\n                                                \"type\": \"integer\",\n                                                \"valueLevel\": 0,\n                                                \"values\": [\n                                                    0\n                                                ],\n                                                \"lengthLevel\": 1,\n                                                \"lengths\": [\n                                                    1\n                                                ],\n                                                \"repeat\": 14\n                                            },\n                                            \"error_detail\": {\n                                                \"notnull\": true,\n                                                \"type\": \"object\",\n                                                \"valueLevel\": 0,\n                                                \"values\": [\n                                                    {\n                                                        \"message\": {\n                                                            \"notnull\": true,\n                                                            \"type\": \"string\",\n                                                            \"valueLevel\": 3,\n                                                            \"values\": [],\n                                                            \"lengthLevel\": 1,\n                                                            \"lengths\": [\n                                                                0\n                                                            ],\n                                                            \"repeat\": 7\n                                                        }\n                                                    }\n                                                ]\n                                            },\n                                            \"loss\": {\n                                                \"notnull\": true,\n                                                \"type\": \"object\",\n                                                \"valueLevel\": 0,\n                                                \"values\": [\n                                                    {\n                                                        \"loss_step\": {\n                                                            \"notnull\": true,\n                                                            \"type\": \"integer\",\n                                                            \"valueLevel\": 0,\n                                                            \"values\": [\n                                                                1\n                                                            ],\n                                                            \"lengthLevel\": 1,\n                                                            \"lengths\": [\n                                                                1\n                                                            ],\n                                                            \"repeat\": 14\n                                                        },\n                                                        \"loss_source\": {\n                                                            \"notnull\": true,\n                                                            \"type\": \"string\",\n                                                            \"valueLevel\": 3,\n                                                            \"values\": [],\n                                                            \"lengthLevel\": 1,\n                                                            \"lengths\": [\n                                                                2\n                                                            ],\n                                                            \"repeat\": 7\n                                                        }\n                                                    }\n                                                ]\n                                            }\n                                        }\n                                    ]\n                                }\n                            }\n                        ],\n                        \"rows\": {\n                            \"type\": \"array\",\n                            \"notnull\": true,\n                            \"comment\": \"回调的详细信息\"\n                        }\n                    }\n                ],\n                \"repeat\": 7,\n                \"comment\": \"回调的详细信息\"\n            }\n        }\n    ]\n}','Authorization: Basic amlndWFuZ2RldjpkZXZfc2VjcmV0','2023-04-25 15:39:38','\n## 概述\n将「消息状态」和「消息响应」的数据回调给企业的业务系统，可根据该信息进行统计、回复用户等动作。\n## 回调地址\n企业需要设置接收「消息状态」以及「消息响应」的回调地址，详情参见 [回调设置](/zh_CN/docs/whatsapp/console/configuration-management/callback-settings)。\n## 回调格式\n请求方式是 POST，请求体为 JSON，数据类型：\"Content-Type: application/json\"<br />一次请求将批量返回多条数据。\n## 安全机制\n待上线。目前回调暂未带上鉴权信息，故开发者接收回调的接口请不要设置权限验证。\n## 应答机制\n开发者服务接收到 Engagelab 的回调后，需要在 3 秒内按下述要求进行应答。<br />**接收成功：**HTTP 应答状态码需返回 200 ，无需返回应答报文。\n## 重试机制\n待上线。\n\n## 请求参数\nEngageLab 向业务系统的回调地址发起的请求参数如下：\n\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| total | int | 必填 | 回调的数据量 |\n| rows | JSON Array | 必填 | 回调的详细信息 |\n\nrows 中的参数如下：\n\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| message_id | string | 可选 | 消息状态以及消息响应的时候返回。 |\n| from | string | 可选 | 发送方，消息状态以及上行消息的时候返回 |\n| to | string | 可选 | 接收方，消息状态以及上行消息的时候返回 |\n| server | string | 必选 | 回调信息所属的产品服务，固定取值 whatsapp |\n| channel | string | 可选 | 该状态或者响应属于哪一个通道，固定取值 whatsapp |\n| itime | int | 必选 | 回调数据真实产生的时间戳，与 message_status 字段相结合，可以得到：请求时间戳、发送时间戳、送达时间戳、已读时间戳 |\n| custom_args | JSON Object | 可选 | 在消息发送时自定义的可选字段，在消息状态回调中原样返回。 |\n| status | JSON Object | 可选 | 消息状态字段 |\n| response | JSON Object | 可选 | 消息响应字段 |\n\n## 消息状态-status\n### 回调参数\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| message_status | string | 必选 | 消息的状态 |\n| status_data | JSON Object | 可选 | 该状态下的详细数据 |\n| error_code | int | 可选 | 错误码，失败时返回 |\n| error_detail | JSON Object | 可选 | 错误详情，失败时返回 |\n| loss | JSON Object | 可选 | 折损阶段和折损来源 |\n\n#### message_status\n| 取值 | 描述 | 定义 |\n| --- | --- | --- |\n| plan | 计划发送 | 该号码在传递的「收件人号码」内，即为该号码记录 1 个计划发送目标的状态 |\n| target_valid | 目标有效 | 通过合法性校验<br />1、该号码被 EngageLab 判定为合法<br />2、该号码被 Meta WhatsApp 服务判定为合法 |\n| sent | 发送成功 | 该号码由 EngageLab 提交给 Meta WhatsApp 服务后返回了成功 |\n| delivered | 送达成功 | 由 Meta WhatsApp 服务确认消息已送达用户 |\n| read | 已读 | 由 Meta WhatsApp 服务确认用户已读消息 |\n| target_invalid | 目标无效 | 1、该号码被 EngageLab 判定为非法<br />2、该号码被 Meta WhatsApp 服务判定为非法 |\n| sent_failed | 发送失败 | 该号码提交给 Meta WhatsApp 服务后返回了失败 |\n| delivered_failed | 送达失败 | 该号码提交给 Meta WhatsApp 服务成功，但 Meta 回调告知失败。 |\n| delivered_timeout | 超时未送达 | 该号码提交给 Meta WhatsApp 服务成功，但在 5 分钟内 Meta 未回调告知是否成功/失败，计为超时。 |\n\n#### status_data\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| msg_time | int | 必填 | 消息下发时间，调用 API 请求发送消息成功的时间点 |\n| channel_message_id | String | 必填 | WhatsApp 官方返回的消息 ID |\n| whatsapp_business_account_id | String | 必填 | 发送号所属的 WhatsApp 商业账户的编号 |\n| timezone | String | 必填 | 组织所在时区 |\n| plan_user_total | int | 可选 | 计划目标总数，只有当 message_status=plan 时这个才会有值 |\n| country_code | String | 必填 | 接收方手机号码归属的国家/地区代码 |\n| from_phone_id | String | 必填 | 发送号码（from）的 ID 标识 |\n| conversation | JSON Object | 可选 | 会话信息 |\n| pricing | JSON Object | 可选 | 价格信息 |\n\n##### conversation\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| id | String | 可选 | 该条消息所属的 Meta 对话 ID |\n| origin | JSON Object | 可选 | 表示是由谁发起的对话。由 type 指定。<br />示例：\"origin\":{\"type\":\"business_initiated\"}，取值如下：<li>business_initiated：示对话由企业向客户发送第一条消息开始。这适用于距离最后一条客户消息超过 24 小时的任何时间。<li>customer_initiated：示对话是由企业回复客户消息开始的。这仅适用于业务回复距离最后一条客户消息在 24 小时内的情况。<li>referral_conversion：示对话源自一个 [自由入口点](https://developers.facebook.com/docs/whatsapp/pricing/conversationpricing#free-entry-points)。这些对话总是由客户发起的。 |\n\n##### pricing\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| pricing_model | String | 可选 | 固定取值为 CBP |\n| category | String | 可选 | 对话定价类别，取值如下：<li>business_initiated：商家对话。<li>customer_initiated： 用户对话。<li>referral_conversion： 免费接入点对话。 |\n\n#### error_detail\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| message | String | 必填 | 错误原因 |\n\n#### loss\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| loss_step | int | 必填 | 折损阶段<li>1：计划目标 ~ 有效目标，即无效目标<li>2：有效目标 ~ 发送，即发送失败<li>3：发送 ~ 送达。即送达失败 |\n| loss_source | String | 必填 | 折损来源，取值：<li>engagelab：EngageLab WhatsApp 服务进行校验产生的折损<li>meta：Meta 官方返回的错误 |\n\n### 回调示例\n```\n{\n    \"total\": 1,\n    \"rows\": [\n        {\n            \"message_id\": \"1666165485030094861\", // EngageLab 的消息 id\n            \"from\": \"\", // 发送方\n            \"to\": \"\", // 接收方\n            \"server\": \"whatsapp\",\n            \"channel\": \"whatsapp\",\n            \"itime\": 1640707579, // 消息状态产生的时间戳，如消息已送达的时间\n            \"custom_args\": {}, // 这条消息创建时提交的参数，将于此回调时原样返回\n            \"status\": {\n                // 成功时响应这些字段\n                \"message_status\": \"delivered\" // 消息状态    \n      \"status_data\": { // 自定义\n                    \"msg_time\": 1663432355, // 消息下发时间，历史记录上的消息发送时间，即用户调用 API 发送消息-调用 API 成功的那个时间\n                    \"channel_message_id\": \"wamid.123321abcdefed==\", // 可选，Meta 返回的 msgid\n                    \"whatsapp_business_account_id\": \"\", //发送号 from 对应的 Whatsapp 商业账户编码\n                    \"timezone\": \"\", //组织时区\n                    \"plan_user_total\": 2007, //计划目标总数，只有当 message_status=plan 时这个才会有值\n                    \"country_code\": \"CN\", //接收方手机号码归属的国家/地区代码\n                    \"from_phone_id\": \"111111\" // 发送号码（from）的 ID 标识\n       \"conversation\": { // 可选，会话信息\n                        \"id\": \"ebe2398cdaa37a0899ca5268b987b0c8\",\n                        \"origin\": {\n                            \"type\": \"business_initiated\"\n                        }\n                    },\n                    \"pricing\": { // 可选，价格信息\n                        \"pricing_model\": \"CBP\",\n                        \"category\": \"business_initiated\"\n                    }\n                },\n                // 失败状态下（无效目标、发送失败、送达失败、未读）返回这些字段\n                \"error_code\": 0, //错误码\n                \"error_detail\": {\n                    \"message\": \"\" //错误原因\n                },\n                \"loss\": {\n                    \"loss_step\": 1,\n                    \"loss_source\": \"aa\"\n                }\n            }\n        }\n    ]\n}\n```\n## 消息响应\n### 回调参数\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| event | string | 可选 | 响应事件 |\n| response_data | JSON Object | 可选 | 上行回复/交互的消息内容 |\n\n#### event\n| 取值 | 描述 | 详细说明 |\n| --- | --- | --- |\n| received | 收到用户的消息 | 用户直接发送了一条消息 |\n| reply | 用户回复了你的消息 | 企业先发送了消息给用户，用户选择对该条信息进行回复 |\n| order | 用户下订单 |  -|\n| deleted | 用户删除了他的消息 | 用户将自己发出的消息删除了（待上线） |\n\n#### response_data\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| channel_message_id | String | 必填 | WhatsApp 官方返回的消息 ID |\n| whatsapp_business_account_id | String | 必填 | 发送号所属的 WhatsApp 商业账户的编号 |\n| contact | JSON Object | 可选 | 发送方信息 |\n| message | JSON Object | 必填 | 消息内容 |\n\n##### contact\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| profile | JSON Object | 可选 | 发送方（客户）的资料，当前仅有 name 字段表示客户的姓名。<br />示例：\"profile\": {\"name\": \"bob\"} |\n| wa_id | String | 可选 | 发送方的号码 |\n\n##### message\n| 字段 | 类型 | 选项 | 描述 |\n| --- | --- | --- | --- |\n| type | String | 必填 | 取值：text、image、audio、video、document、sticker、button、interactive、unknown、order |\n| text | JSON Object | 可选 | 详见 [text object 说明](/zh_CN/docs/whatsapp/rest-api/send-message-api#text-object-说明) |\n| image | JSON Object | 可选 | 详见 [image object 说明](/zh_CN/docs/whatsapp/rest-api/send-message-api#image-object-说明) |\n| audio | JSON Object | 可选 | 详见 [audio object 说明](/zh_CN/docs/whatsapp/rest-api/send-message-api#audio-object-说明) |\n| video | JSON Object | 可选 | 详见 [video object 说明](/zh_CN/docs/whatsapp/rest-api/send-message-api#video-object-说明) |\n| document | JSON Object | 可选 | 详见 [document object 说明](/zh_CN/docs/whatsapp/rest-api/send-message-api#document-object-说明) |\n| sticker | JSON Object | 可选 | 详见 [sticker object 说明](/zh_CN/docs/whatsapp/rest-api/send-message-api#sticker-object-说明) |\n\n### 回调示例\n```\n{\n    \"total\": 1,\n    \"rows\": [\n        {\n            \"message_id\": \"1666165485030094861\", // 极光侧的消息 id\n            \"from\": \"\", // 发送方，即客户的手机号码\n            \"to\": \"\", // 接收方，即开发者的发送号\n            \"server\": \"whatsapp\",\n            \"channel\": \"whatsapp\",\n            \"itime\": 1640707579, // 时间戳\n            \"response\": {\n                \"event\": \"\", // 响应事件\n                \"response_data\": { // 具体消息内容\n                    \"channel_message_id\": \"wamid.123321abcdefed==\", // 可选，Meta 返回的 msgid\n                    \"whatsapp_business_account_id\": \"123321\", //开发者的发送号 to 对应的 Whatsapp 商业账户编码\n                    \"contact\": { // 可选，发送方信息\n                        \"profile\": {\n                            \"name\": \"bob\" // 发送方的昵称\n                        },\n                        \"wa_id\": \"8613800138000\" // 发送方的号码\n                    },\n                    \"message\": { // 具体消息内容\n                        \"type\": \"text\", // 消息的类型，可以根据这个值来识别具体消息字段，如 text 则内容为 text 字段\n                        \"text\": { // 消息内容\n                            \"body\": \"here is the message content text\"\n                        }\n                    }\n                }\n            }\n        }\n    ]\n}\n```'),(1688712102374,0,0,1688710551421,NULL,0,3,NULL,'KK',NULL,NULL,'','/','{\n    \"type\": 0,\n    \"phone\": \"13000082001\",\n    \"password\": \"123456\",\n    \"version\": 1,\n    \"remember\": false,\n    \"format\": false,\n    \"defaults\": {\n        \"@database\": \"MYSQL\",\n        \"@schema\": \"sys\"\n    }\n}',NULL,NULL,'{\n    \"notnull\": true,\n    \"type\": \"object\",\n    \"valueLevel\": 0,\n    \"values\": [\n        {\n            \"type\": {\n                \"notnull\": true,\n                \"type\": \"integer\",\n                \"valueLevel\": 0,\n                \"values\": [\n                    0\n                ],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    1\n                ]\n            },\n            \"phone\": {\n                \"notnull\": true,\n                \"type\": \"string\",\n                \"valueLevel\": 3,\n                \"values\": [],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    11\n                ]\n            },\n            \"password\": {\n                \"notnull\": true,\n                \"type\": \"string\",\n                \"valueLevel\": 3,\n                \"values\": [],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    6\n                ]\n            },\n            \"version\": {\n                \"notnull\": true,\n                \"type\": \"integer\",\n                \"valueLevel\": 0,\n                \"values\": [\n                    1\n                ],\n                \"lengthLevel\": 1,\n                \"lengths\": [\n                    1\n                ]\n            },\n            \"remember\": {\n                \"notnull\": true,\n                \"type\": \"boolean\",\n                \"value